\"Votre mot de passe n’est pas valide : $1\n\nVeuillez choisir un nouveau mot de passe maintenant, ou cliquez sur « {{int:resetpass-submit-cancel}} » pour le réinitialiser plus tard.\";'),('fr','messages:passwordreset','s:31:\"Remise à zéro du mot de passe\";'),('fr','messages:passwordreset-text-one','s:64:\"Remplissez ce formulaire pour réinitialiser votre mot de passe.\";'),('fr','messages:passwordreset-text-many','s:93:\"{{PLURAL:$1|Remplissez un des champs pour recevoir un mot de passe temporaire par courriel.}}\";'),('fr','messages:passwordreset-disabled','s:72:\"La réinitialisation des mots de passe a été désactivée sur ce wiki.\";'),('fr','messages:passwordreset-emaildisabled','s:64:\"Les fonctionnalités e-mail ont été désactivées sur ce wiki.\";'),('fr','messages:passwordreset-username','s:19:\"Nom d\'utilisateur :\";'),('fr','messages:passwordreset-domain','s:9:\"Domaine :\";'),('fr','messages:passwordreset-capture','s:29:\"Voir le courriel résultant ?\";'),('fr','messages:passwordreset-capture-help','s:143:\"Si vous cochez cette case, le courriel (avec le mot de passe temporaire) vous sera affiché en même temps qu\'il sera envoyé à l\'utilisateur.\";'),('fr','messages:passwordreset-email','s:21:\"Adresse de courriel :\";'),('fr','messages:passwordreset-emailtitle','s:35:\"Détails du compte sur {{SITENAME}}\";'),('fr','messages:passwordreset-emailtext-ip','s:688:\"Quelqu\'un (probablement vous, depuis l\'adresse IP $1) a demandé un réinitialisation de votre mot de passe pour {{SITENAME}} ($4). {{PLURAL:$3|Le compte utilisateur suivant est associé|Les comptes utilisateurs suivants sont associés}} à cette adresse de courriel :\n\n$2\n\n{{PLURAL:$3|Ce mot de passe temporaire expirera|Ces mots de passe temporaires expireront}} dans {{PLURAL:$5|un jour|$5 jours}}. Vous devez maintenant vous connecter et choisir un nouveau mot de passe. Si cette demande ne provient pas de vous, ou que vous avez retrouvé votre mot de passe initial, et ne souhaitez plus le modifier, vous pouvez ignorer ce message et continuer à utiliser votre ancien mot de passe.\";'),('fr','messages:passwordreset-emailtext-user','s:668:\"L\'utilisateur $1 sur {{SITENAME}} a demandé un réinitialisation de votre mot de passe pour {{SITENAME}} ($4). {{PLURAL:$3|Le compte utilisateur suivant est associé|Les comptes utilisateurs suivants sont associés}} à cette adresse de courriel :\n\n$2\n\n{{PLURAL:$3|Ce mot de passe temporaire expirera|Ces mots de passe temporaires expireront}} dans {{PLURAL:$5|un jour|$5 jours}}. Vous devez maintenant vous connecter et choisir un nouveau mot de passe. Si cette demande ne provient pas de vous, ou que vous avez retrouvé votre mot de passe initial, et ne souhaitez plus le modifier, vous pouvez ignorer ce message et continuer à utiliser votre ancien mot de passe.\";'),('fr','messages:passwordreset-emailelement','s:54:\"Nom d\'utilisateur : \n$1\n\nMot de passe temporaire : \n$2\";'),('fr','messages:passwordreset-emailsent','s:65:\"Un courriel de réinitialisation de mot de passe a été envoyé.\";'),('fr','messages:passwordreset-emailsent-capture','s:94:\"Un courriel de réinitialisation de mot de passe a été envoyé, qui est affiché ci-dessous.\";'),('fr','messages:passwordreset-emailerror-capture','s:169:\"Un courriel de réinitialisation de mot de passe a été généré, qui est affiché ci-dessous, mais l\'envoi à l\'{{GENDER:$2|utilisateur|utilisatrice}} a échoué : $1\";'),('fr','messages:changeemail','s:31:\"Changer l’adresse de courriel\";'),('fr','messages:changeemail-text','s:132:\"Remplissez ce formulaire pour changer votre adresse de courriel. Vous devrez entrer votre mot de passe pour confirmer ce changement.\";'),('fr','messages:changeemail-no-info','s:75:\"Vous devez être connecté pour pouvoir accéder directement à cette page.\";'),('fr','messages:changeemail-oldemail','s:30:\"Adresse de courriel actuelle :\";'),('fr','messages:changeemail-newemail','s:30:\"Nouvelle adresse de courriel :\";'),('fr','messages:changeemail-none','s:8:\"(aucune)\";'),('fr','messages:changeemail-password','s:37:\"Votre mot de passe sur {{SITENAME}} :\";'),('fr','messages:changeemail-submit','s:31:\"Changer l’adresse de courriel\";'),('fr','messages:changeemail-throttled','s:89:\"Vous avez fait trop de tentatives de connexion.\nVeuillez attendre $1 avant de réessayer.\";'),('fr','messages:changeemail-nochange','s:80:\"Veuillez saisir une nouvelle adresse de courriel différente de la précédente.\";'),('fr','messages:resettokens','s:25:\"Réinitialiser les jetons\";'),('fr','messages:resettokens-text','s:249:\"Ici, vous pouvez réinitialiser les jetons qui permettent d’accéder à certaines données privées associées à votre compte.\n\nVous devriez le faire si vous les avez partagés accidentellement avec quelqu\'un ou si votre compte a été compromis.\";'),('fr','messages:resettokens-no-tokens','s:41:\"Il n’y a aucun jeton à réinitialiser.\";'),('fr','messages:resettokens-tokens','s:8:\"Jetons :\";'),('fr','messages:resettokens-token-label','s:25:\"$1 (valeur actuelle : $2)\";'),('fr','messages:resettokens-watchlist-token','s:105:\"Jeton pour le flux (Atom/RSS) web de [[Special:Watchlist|modifications de pages de votre liste de suivi]]\";'),('fr','messages:resettokens-done','s:23:\"Jetons réinitialisés.\";'),('fr','messages:resettokens-resetbutton','s:40:\"Réinitialiser les jetons sélectionnés\";'),('fr','messages:bold_sample','s:10:\"Texte gras\";'),('fr','messages:bold_tip','s:10:\"Texte gras\";'),('fr','messages:italic_sample','s:14:\"Texte italique\";'),('fr','messages:italic_tip','s:14:\"Texte italique\";'),('fr','messages:link_sample','s:13:\"Titre du lien\";'),('fr','messages:link_tip','s:12:\"Lien interne\";'),('fr','messages:extlink_sample','s:36:\"http://www.example.com titre du lien\";'),('fr','messages:extlink_tip','s:48:\"Lien externe (n\'oubliez pas le préfixe http://)\";'),('fr','messages:headline_sample','s:14:\"Texte du titre\";'),('fr','messages:headline_tip','s:19:\"Sous-titre niveau 2\";'),('fr','messages:nowiki_sample','s:32:\"Entrez le texte non formaté ici\";'),('fr','messages:nowiki_tip','s:23:\"Ignorer la syntaxe wiki\";'),('fr','messages:image_sample','s:11:\"Exemple.jpg\";'),('fr','messages:image_tip','s:16:\"Fichier inséré\";'),('fr','messages:media_sample','s:11:\"Exemple.ogg\";'),('fr','messages:media_tip','s:27:\"Lien vers un fichier média\";'),('fr','messages:sig_tip','s:28:\"Votre signature avec la date\";'),('fr','messages:hr_tip','s:36:\"Ligne horizontale (ne pas en abuser)\";'),('fr','messages:summary','s:10:\"Résumé :\";'),('fr','messages:subject','s:15:\"Sujet / titre :\";'),('fr','messages:minoredit','s:20:\"Modification mineure\";'),('fr','messages:watchthis','s:17:\"Suivre cette page\";'),('fr','messages:savearticle','s:11:\"Enregistrer\";'),('fr','messages:preview','s:17:\"Prévisualisation\";'),('fr','messages:showpreview','s:14:\"Prévisualiser\";'),('fr','messages:showdiff','s:22:\"Voir les modifications\";'),('fr','messages:blankarticle','s:165:\"<strong>Attention :</strong> La page que vous créez est vide.\nSi vous cliquez de nouveau sur « {{int:savearticle}} », la page sera créée sans aucun contenu.\";'),('fr','messages:anoneditwarning','s:318:\"<strong>Attention :</strong> Vous n’êtes pas connecté. Votre adresse IP sera visible de tout le monde si vous faites des modifications. Si vous <strong>[$1 vous connectez]</strong> ou <strong>[$2 créez un compte]</strong>, vos modifications seront attribuées à votre nom d’utilisateur, entre autres avantages.\";'),('fr','messages:anonpreviewwarning','s:140:\"\'\'Vous n’êtes pas identifié{{GENDER:||e}}. Sauvegarder enregistrera votre adresse IP dans l’historique des modifications de la page.\'\'\";'),('fr','messages:missingsummary','s:200:\"\'\'\'Rappel :\'\'\' vous n\'avez pas encore fourni le résumé de votre modification.\nSi vous cliquez de nouveau sur le bouton « {{int:savearticle}} », la publication sera faite sans nouvel avertissement.\";'),('fr','messages:selfredirect','s:305:\"<strong>Attention :</strong> Vous êtes en train de rediriger la page vers elle-même.\nVous pouvez avoir spécifié la mauvaise cible pour la redirection, ou vous modifiez peut-être la mauvaise page.\nSi vous cliquez de nouveau sur « {{int:savearticle}} », la redirection sera créée tout de même.\";'),('fr','messages:missingcommenttext','s:42:\"Veuillez entrer un commentaire ci-dessous.\";'),('fr','messages:missingcommentheader','s:184:\"\'\'\'Rappel :\'\'\' vous n\'avez pas fourni de sujet ou de titre à ce commentaire.\nSi vous cliquez de nouveau sur « {{int:Savearticle}} », votre modification sera enregistrée sans titre.\";'),('fr','messages:summary-preview','s:21:\"Aperçu du résumé :\";'),('fr','messages:subject-preview','s:34:\"Prévisualisation du sujet/titre :\";'),('fr','messages:previewerrortext','s:91:\"Une erreur s’est produite lors de la tentative de prévisualisation de vos modifications.\";'),('fr','messages:blockedtitle','s:28:\"L’utilisateur est bloqué.\";'),('fr','messages:blockedtext','s:703:\"\'\'\'Votre compte utilisateur ou votre adresse IP a été bloqué.\'\'\'\n\nLe blocage a été effectué par $1.\nLa raison invoquée est la suivante : \'\'$2\'\'.\n\n* Début du blocage : $8\n* Expiration du blocage : $6\n* Compte bloqué : $7.\n\nVous pouvez contacter $1 ou un autre [[{{MediaWiki:Grouppage-sysop}}|administrateur]] pour en discuter.\nVous ne pouvez utiliser la fonction « {{int:emailuser}} » que si une adresse de courriel valide est spécifiée dans vos [[Special:Preferences|préférences]] et que si cette fonctionnalité n’a pas été bloquée.\nVotre adresse IP actuelle est $3 et votre identifiant de blocage est $5.\nVeuillez préciser ces indications dans toutes les requêtes que vous ferez.\";'),('fr','messages:autoblockedtext','s:747:\"Votre adresse IP a été bloquée automatiquement car elle a été utilisée par un autre utilisateur, lui-même bloqué par $1.\nLa raison invoquée est :\n\n:\'\'$2\'\'\n\n* Début du blocage : $8\n* Expiration du blocage : $6\n* Compte bloqué : $7\n\nVous pouvez contacter $1 ou l’un des autres [[{{MediaWiki:Grouppage-sysop}}|administrateurs]] pour discuter de ce blocage.\n\nNotez que vous ne pourrez utiliser la fonctionnalité d’envoi de courriel que si vous avez une adresse de courriel validée dans vos [[Special:Preferences|préférences]] et que si cette fonctionnalité n’a pas été désactivée.\n\nVotre adresse IP actuelle est $3, et le numéro de blocage est $5.\nVeuillez préciser ces indications dans toutes les requêtes que vous ferez.\";'),('fr','messages:blockednoreason','s:21:\"aucune raison donnée\";'),('fr','messages:whitelistedittext','s:67:\"Vous devez vous $1 pour avoir la permission de modifier le contenu.\";'),('fr','messages:confirmedittext','s:176:\"Vous devez confirmer votre adresse de courriel avant de modifier les pages.\nVeuillez entrer et valider votre adresse de courriel dans vos [[Special:Preferences|préférences]].\";'),('fr','messages:nosuchsectiontitle','s:32:\"Impossible de trouver la section\";'),('fr','messages:nosuchsectiontext','s:144:\"Vous avez essayé de modifier une section qui n\'existe pas.\nElle a peut-être été déplacée ou supprimée depuis que vous avez lu cette page.\";'),('fr','messages:loginreqtitle','s:21:\"Connexion nécessaire\";'),('fr','messages:loginreqlink','s:9:\"connecter\";'),('fr','messages:loginreqpagetext','s:46:\"Vous devez vous $1 pour voir les autres pages.\";'),('fr','messages:accmailtitle','s:21:\"Mot de passe envoyé.\";'),('fr','messages:accmailtext','s:199:\"Un mot de passe généré aléatoirement pour [[User talk:$1|$1]] a été envoyé à $2.\nIl peut être modifié sur la page \'\'[[Special:ChangePassword|Changement de mot de passe]]\'\' après connexion.\";'),('fr','messages:newarticle','s:9:\"(Nouveau)\";'),('fr','messages:newarticletext','s:319:\"Vous avez suivi un lien vers une page qui n’existe pas encore. \nAfin de créer cette page, entrez votre texte dans la boîte ci-après (vous pouvez consulter [$1 la page d’aide] pour plus d’informations). \nSi vous êtes arrivé{{GENDER:||e}} ici par erreur, cliquez sur le bouton \'\'\'retour\'\'\' de votre navigateur.\";'),('fr','messages:anontalkpagetext','s:611:\"---- \'\'Vous êtes sur la page de discussion d\'un utilisateur anonyme qui n\'a pas encore créé de compte ou qui n\'en utilise pas. Pour cette raison, nous devons utiliser son adresse IP pour l\'identifier. Une adresse IP peut être partagée par plusieurs utilisateurs. Si vous êtes un{{GENDER:||e|}} utilisat{{GENDER:|eur|rice|eur}} anonyme et si vous constatez que des commentaires qui ne vous concernent pas vous ont été adressés, vous pouvez [[Special:UserLogin/signup|créer un compte]] ou [[Special:UserLogin|vous connecter]] afin d\'éviter toute confusion future avec d\'autres contributeurs anonymes.\'\'\";'),('fr','messages:noarticletext','s:346:\"Il n’y a pour l’instant aucun texte sur cette page.\nVous pouvez [[Special:Search/{{PAGENAME}}|lancer une recherche sur ce titre]] dans les autres pages,\n<span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} rechercher dans les opérations liées]\nou [{{fullurl:{{FULLPAGENAME}}|action=edit}} créer cette page]</span>.\";'),('fr','messages:noarticletext-nopermission','s:280:\"Il n\'y a pour l\'instant aucun texte sur cette page.\nVous pouvez [[Special:Search/{{PAGENAME}}|faire une recherche sur ce titre]] dans les autres pages,\nou <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} rechercher dans les journaux associés]</span>.\";'),('fr','messages:missing-revision','s:316:\"La révision n° $1 de la page intitulée « {{FULLPAGENAME}} » n\'existe pas.\n\nCela survient en général en suivant un lien historique obsolète vers une page qui a été supprimée.\nVous pouvez trouver plus de détails dans le [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} journal des suppressions].\";'),('fr','messages:userpage-userdoesnotexist','s:124:\"Le compte utilisateur « <nowiki>$1</nowiki> » n\'est pas enregistré. Veuillez vérifier que vous voulez créer cette page.\";'),('fr','messages:userpage-userdoesnotexist-view','s:53:\"Le compte utilisateur « $1 » n\'est pas enregistré.\";'),('fr','messages:blocked-notice-logextract','s:138:\"Cet utilisateur est actuellement bloqué.\nLa dernière entrée du journal des blocages est indiquée ci-dessous à titre d’information :\";'),('fr','messages:clearyourcache','s:619:\"\'\'\'Note :\'\'\' après avoir enregistré vos modifications, il se peut que vous deviez forcer le rechargement complet du cache de votre navigateur pour voir les changements.\n* \'\'\'Firefox / Safari :\'\'\' Maintenez la touche \'\'Maj\'\' (\'\'Shift\'\') en cliquant sur le bouton \'\'Actualiser\'\' ou pressez \'\'Ctrl-F5\'\' ou \'\'Ctrl-R\'\' (\'\'⌘-R\'\' sur un Mac) ;\n* \'\'\'Google Chrome :\'\'\' Appuyez sur \'\'Ctrl-Maj-R\'\' (\'\'⌘-Shift-R\'\' sur un Mac) ;\n* \'\'\'Internet Explorer :\'\'\' Maintenez la touche \'\'Ctrl\'\' en cliquant sur le bouton \'\'Actualiser\'\' ou pressez \'\'Ctrl-F5\'\' ;\n* \'\'\'Opera :\'\'\' Videz le cache dans \'\'Outils → Préférences\'\'.\";'),('fr','messages:usercssyoucanpreview','s:122:\"\'\'\'Astuce :\'\'\' utilisez le bouton « {{int:showpreview}} » pour tester votre nouvelle feuille CSS avant de l\'enregistrer.\";'),('fr','messages:userjsyoucanpreview','s:129:\"\'\'\'Astuce :\'\'\' utilisez le bouton « {{int:showpreview}} » pour tester votre nouvelle feuille JavaScript avant de l\'enregistrer.\";'),('fr','messages:usercsspreview','s:139:\"\'\'\'Rappelez-vous que vous n\'êtes qu\'en train de prévisualiser votre propre feuille CSS.\'\'\'\n\'\'\'Elle n\'a pas encore été enregistrée !\'\'\'\";'),('fr','messages:userjspreview','s:136:\"\'\'\'Rappelez-vous que vous êtes en train de visualiser ou de tester votre code JavaScript et qu\'il n\'a pas encore été enregistré !\'\'\'\";'),('fr','messages:sitecsspreview','s:142:\"\'\'\'Souvenez-vous que vous êtes seulement en train de prévisualiser cette feuille de style.\'\'\'\n\'\'\'Elle n\'a pas encore été enregistrée !\'\'\'\";'),('fr','messages:sitejspreview','s:135:\"\'\'\'Souvenez-vous que vous êtes seulement en train de prévisualiser ce code JavaScript.\'\'\'\n\'\'\'Il n\'a pas encore été enregistré !\'\'\'\";'),('fr','messages:userinvalidcssjstitle','s:234:\"\'\'\'Attention :\'\'\' il n\'existe pas d\'habillage « $1 ». Rappelez-vous que les pages personnelles avec extensions .css et .js utilisent des titres en minuscules, par exemple {{ns:user}}:Foo/vector.css et non {{ns:user}}:Foo/Vector.css.\";'),('fr','messages:updated','s:13:\"(Mis à jour)\";'),('fr','messages:note','s:12:\"\'\'\'Note :\'\'\'\";'),('fr','messages:previewnote','s:115:\"\'\'\'Rappelez-vous que ce n\'est qu\'une prévisualisation.\'\'\'\nVos modifications n\'ont pas encore été enregistrées !\";'),('fr','messages:continue-editing','s:32:\"Aller à la zone de modification\";'),('fr','messages:previewconflict','s:136:\"Cette prévisualisation montre le texte de la boîte supérieure de modification tel qu\'il apparaîtra si vous choisissez de le publier.\";'),('fr','messages:session_fail_preview','s:244:\"\'\'\'Nous ne pouvons enregistrer votre modification à cause d\'une perte d\'informations concernant votre session.\'\'\'\nVeuillez réessayer.\nSi cela échoue de nouveau, essayez en vous [[Special:UserLogout|déconnectant]], puis en vous reconnectant.\";'),('fr','messages:session_fail_preview_html','s:422:\"\'\'\'Nous ne pouvons enregistrer votre modification à cause d\'une perte d\'informations concernant votre session.\'\'\'\n\n\'\'Parce que {{SITENAME}} a activé le HTML brut, la prévisualisation a été masquée afin de prévenir les attaques par JavaScript.\'\'\n\n\'\'\'Si la tentative de modification était légitime, veuillez réessayer.\'\'\'\nSi cela échoue de nouveau, [[Special:UserLogout|déconnectez-vous]], puis reconnectez-vous.\";'),('fr','messages:token_suffix_mismatch','s:340:\"\'\'\'Votre modification n\'a pas été acceptée car votre navigateur a mal codé les caractères de ponctuation dans l\'identifiant de modification.\'\'\'\nCe rejet est nécessaire pour empêcher la corruption du texte de la page.\nCe problème se produit parfois lorsque vous utilisez un serveur mandataire anonyme problématique basé sur le web.\";'),('fr','messages:edit_form_incomplete','s:152:\"\'\'\'Certaines parties du formulaire de modification n\'ont pas atteint le serveur, vérifiez que vos modifications sont intactes et essayez à nouveau.\'\'\'\";'),('fr','messages:editing','s:18:\"Modification de $1\";'),('fr','messages:creating','s:15:\"Création de $1\";'),('fr','messages:editingsection','s:28:\"Modification de $1 (section)\";'),('fr','messages:editingcomment','s:37:\"Modification de $1 (nouvelle section)\";'),('fr','messages:editconflict','s:28:\"Conflit de modification : $1\";'),('fr','messages:explainconflict','s:443:\"Cette page a été changée après que vous ayez commencé à la modifier.\nLa zone de modification supérieure contient le texte tel qu\'il est actuellement enregistré dans la base de données.\nVos modifications apparaissent dans la zone de modification inférieure.\nVous allez devoir fusionner vos modifications dans le texte existant.\n\'\'\'Seul\'\'\' le texte de la zone supérieure sera sauvegardé si vous cliquez sur « {{int:savearticle}} ».\";'),('fr','messages:yourtext','s:11:\"Votre texte\";'),('fr','messages:storedversion','s:23:\"La version enregistrée\";'),('fr','messages:nonunicodebrowser','s:321:\"\'\'\'Attention : Votre navigateur ne supporte pas l\'Unicode.\'\'\'\nUne solution de rechange a été trouvée pour vous permettre de modifier en toute sûreté une page : les caractères non-ASCII apparaîtront dans votre boîte de modification en tant que codes hexadécimaux. Vous devriez utiliser un navigateur plus récent.\";'),('fr','messages:editingold','s:179:\"\'\'\'Attention : vous êtes en train de modifier une ancienne version de cette page.\nSi vous la publiez, toutes les modifications effectuées depuis cette version seront perdues.\'\'\'\";'),('fr','messages:yourdiff','s:12:\"Différences\";'),('fr','messages:copyrightwarning','s:508:\"Toutes les contributions à {{SITENAME}} sont considérées comme publiées sous les termes de la $2 (voir $1 pour plus de détails). Si vous ne désirez pas que vos écrits soient modifiés et distribués à volonté, merci de ne pas les soumettre ici.<br />\nVous nous promettez aussi que vous avez écrit ceci vous-même, ou que vous l’avez copié d’une source provenant du domaine public, ou d’une ressource libre. \'\'\'N’UTILISEZ PAS DE TRAVAUX SOUS DROIT D’AUTEUR SANS AUTORISATION EXPRESSE !\'\'\'\";'),('fr','messages:copyrightwarning2','s:517:\"Toutes les contributions à {{SITENAME}} peuvent être modifiées ou supprimées par d’autres utilisateurs. Si vous ne désirez pas que vos écrits soient modifiés et distribués à volonté, merci de ne pas les soumettre ici.<br \n/>Vous nous promettez aussi que vous avez écrit ceci vous-même, ou que vous l’avez copié d’une source provenant du domaine public, ou d’une ressource libre. (voir $1 pour plus de détails).\n\'\'\'N’UTILISEZ PAS DE TRAVAUX SOUS DROIT D’AUTEUR SANS AUTORISATION EXPRESSE !\'\'\'\";'),('fr','messages:editpage-cannot-use-custom-model','s:63:\"Le modèle de contenu de cette page ne peut pas être modifié.\";'),('fr','messages:longpageerror','s:176:\"\'\'\'Erreur: Le texte que vous avez soumis fait {{PLURAL:$1|un Kio|$1 Kio}}, ce qui dépasse la limite fixée à {{PLURAL:$2|un Kio|$2 Kio}}.\'\'\'\nIl ne peut pas être sauvegardé.\";'),('fr','messages:readonlywarning','s:362:\"\'\'\'AVERTISSEMENT : la base de données a été verrouillée pour des opérations de maintenance. Vous ne pouvez donc pas publier vos modifications pour l’instant.\'\'\'\nVous pouvez copier et coller votre texte dans un fichier texte et l’enregistrer pour plus tard.\n\nL’administrateur ayant verrouillé la base de données a donné l’explication suivante : $1\";'),('fr','messages:protectedpagewarning','s:207:\"\'\'\'AVERTISSEMENT : cette page est protégée. Seuls les utilisateurs ayant le statut d\'administrateur peuvent la modifier.\'\'\'<br />\nLa dernière entrée du journal est affichée ci-dessous pour référence :\";'),('fr','messages:semiprotectedpagewarning','s:197:\"\'\'\'Note :\'\'\' Cette page a été protégée de telle façon que seuls les contributeurs enregistrés puissent la modifier. La dernière entrée du journal est affichée ci-dessous pour référence :\";'),('fr','messages:cascadeprotectedwarning','s:277:\"\'\'\'ATTENTION :\'\'\' Cette page a été protégée de manière à ce que seuls les administrateurs puissent la modifier car elle est transcluse dans {{PLURAL:$1|la page protégée suivante, qui a|les pages protégées suivantes, qui ont}} la « protection en cascade » activée :\";'),('fr','messages:titleprotectedwarning','s:233:\"\'\'\'ATTENTION : Cette page a été protégée de telle manière que des [[Special:ListGroupRights|droits spécifiques]] sont requis pour pouvoir la créer.\'\'\' La dernière entrée du journal est affichée ci-dessous pour référence :\";'),('fr','messages:templatesused','s:66:\"{{PLURAL:$1|Modèle utilisé|Modèles utilisés}} par cette page :\";'),('fr','messages:templatesusedpreview','s:80:\"{{PLURAL:$1|Modèle utilisé|Modèles utilisés}} dans cette prévisualisation :\";'),('fr','messages:templatesusedsection','s:70:\"{{PLURAL:$1|Modèle utilisé|Modèles utilisés}} dans cette section :\";'),('fr','messages:template-protected','s:11:\"(protégé)\";'),('fr','messages:template-semiprotected','s:16:\"(semi-protégé)\";'),('fr','messages:hiddencategories','s:83:\"{{PLURAL:$1|Catégorie cachée|Catégories cachées}} dont cette page fait partie :\";'),('fr','messages:edittools','s:127:\"<!-- Tout texte entré ici sera affiché sous les boîtes de modification ou les formulaires de téléversement de fichier. -->\";'),('fr','messages:edittools-upload','s:3:\"—\";'),('fr','messages:nocreatetext','s:200:\"{{SITENAME}} a restreint la possibilité de créer de nouvelles pages.\nVous pouvez revenir en arrière et modifier une page existante, ou bien [[Special:UserLogin|vous co