expensive-parserfunction-warning','s:199:\"Attention : cette page contient de trop nombreux appels à des fonctions coûteuses de l\'analyseur syntaxique.\n\nIl devrait y avoir moins de $2 appel{{PLURAL:$2||s}}, alors qu\'il y en a maintenant $1.\";'),('fr','messages:expensive-parserfunction-category','s:75:\"Pages avec trop d\'appels dispendieux de fonctions de l\'analyseur syntaxique\";'),('fr','messages:post-expand-template-inclusion-warning','s:110:\"Attention : Cette page contient trop d\'inclusions de modèles. Certaines inclusions ne seront pas effectuées.\";'),('fr','messages:post-expand-template-inclusion-category','s:45:\"Pages contenant trop d\'inclusions de modèles\";'),('fr','messages:post-expand-template-argument-warning','s:201:\"Attention : Cette page contient au moins un paramètre de modèle dont l\'inclusion est rendue impossible. Après extension, celui-ci aurait produit un résultat trop long, il n\'a donc pas été inclus.\";'),('fr','messages:post-expand-template-argument-category','s:56:\"Pages contenant des paramètres de modèle non évalués\";'),('fr','messages:parser-template-loop-warning','s:36:\"Modèle en boucle détecté : [[$1]]\";'),('fr','messages:parser-template-recursion-depth-warning','s:59:\"Limite de profondeur des appels de modèles dépassée ($1)\";'),('fr','messages:language-converter-depth-warning','s:63:\"Limite de profondeur du convertisseur de langue dépassée ($1)\";'),('fr','messages:node-count-exceeded-category','s:40:\"Pages où nombre de nœuds est dépassé\";'),('fr','messages:node-count-exceeded-category-desc','s:48:\"Cette page dépasse le nombre maximal de nœuds.\";'),('fr','messages:node-count-exceeded-warning','s:35:\"Page dépassant le nombre de nœuds\";'),('fr','messages:expansion-depth-exceeded-category','s:50:\"Pages où la profondeur d\'expansion est dépassée\";'),('fr','messages:expansion-depth-exceeded-category-desc','s:54:\"La page dépasse la profondeur d’expansion maximale.\";'),('fr','messages:expansion-depth-exceeded-warn