ier portant ce nom a été supprimé ou déplacé.\'\'\'\n\nLe journal des suppressions et celui des déplacements de cette page sont affichés ici pour informations :\";'),('fr','messages:uploadtext','s:973:\"Utilisez ce formulaire pour importer des fichiers sur le serveur.\nPour voir ou rechercher des images précédemment envoyées, consultez la [[Special:FileList|liste des images]]. L’import est aussi enregistré dans le [[Special:Log/upload|journal d’import des fichiers]], et les suppressions dans le [[Special:Log/delete|journal des suppressions]].\n\nPour inclure un fichier dans une page, utilisez un lien de la forme :\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:fichier.jpg]]</nowiki></code>\'\'\', pour afficher le fichier en pleine résolution (dans le cas d’une image) ;\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:fichier.png|200px|thumb|left|texte descriptif]]</nowiki></code>\'\'\' pour utiliser une miniature de 200 pixels de large dans une boîte à gauche avec « texte descriptif » comme description ;\n* \'\'\'<code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:fichier.ogg]]</nowiki></code>\'\'\' pour lier directement vers le fichier sans l’afficher.\";'),('fr','messages:upload-permitted','s:81:\"{{PLURAL:$2|Format|Formats}} de fichiers {{PLURAL:$2|autorisé|autorisés}} : $1.\";'),('fr','messages:upload-preferred','s:83:\"{{PLURAL:$2|Format|Formats}} de fichiers {{PLURAL:$2|préféré|préférés}} : $1.\";'),('fr','messages:upload-prohibited','s:82:\"‎{{PLURAL:$2|Format|Formats}} de fichiers {{PLURAL:$2|interdit|interdits}} : $1.\";'),('fr','messages:uploadlogpage','s:30:\"Journal d’import de fichiers\";'),('fr','messages:uploadlogpagetext','s:159:\"Voici la liste des derniers fichiers importés sur le serveur.\nVoyez la [[Special:NewFiles|galerie des nouvelles images]] pour une présentation plus visuelle.\";'),('fr','messages:filename','s:14:\"Nom du fichier\";'),('fr','messages:filedesc','s:11:\"Description\";'),('fr','messages:fileuploadsummary','s:13:\"Descrip