nir le vandalisme et en accord avec les [[{{MediaWiki:Policy-url}}|règles internes]].\nDonnez ci-dessous un motif précis (par exemple en citant les pages qui ont été vandalisées).\";'),('fr','messages:ipaddressorusername','s:33:\"Adresse IP ou nom d\'utilisateur :\";'),('fr','messages:ipbexpiry','s:25:\"Durée avant expiration :\";'),('fr','messages:ipbreason','s:7:\"Motif :\";'),('fr','messages:ipbreason-dropdown','s:411:\"* Motifs de blocage les plus fréquents\n** Insertion de fausses informations\n** Suppression injustifiée de contenu des pages\n** Insertion répétée de liens externes publicitaires (pollupostage)\n** Insertion de contenu sans aucun sens et de déchets dans les pages\n** Tentative d\'intimidation ou harcèlement\n** Abus d\'utilisation de comptes multiples\n** Nom d\'utilisateur inacceptable, injurieux ou diffamant\";'),('fr','messages:ipb-hardblock','s:79:\"Empêcher les utilisateurs connectés de modifier en utilisant cette adresse IP\";'),('fr','messages:ipbcreateaccount','s:32:\"Empêcher la création de compte\";'),('fr','messages:ipbemailban','s:47:\"Empêcher l\'utilisateur d\'envoyer des courriels\";'),('fr','messages:ipbenableautoblock','s:129:\"Bloquer automatiquement la dernière adresse IP utilisée par l\'utilisateur et toutes ses IPs ultérieures qu\'il pourrait essayer\";'),('fr','messages:ipbsubmit','s:7:\"Bloquer\";'),('fr','messages:ipbother','s:14:\"Autre durée :\";'),('fr','messages:ipboptions','s:162:\"2 heures:2 hours,1 jour:1 day,3 jours:3 days,1 semaine:1 week,2 semaines:2 weeks,1 mois:1 month,3 mois:3 months,6 mois:6 months,1 an:1 year,indéfiniment:infinite\";'),('fr','messages:ipbhidename','s:60:\"Masquer le nom d\'utilisateur des modifications et des listes\";'),('fr','messages:ipbwatchuser','s:64:\"Suivre les pages utilisateur et de discussion de cet utilisateur\";'),('fr','messages:ipb-disableusertalk','s:76:\"Empêcher l\'utilisateur de modifier sa page de discussion pendant le blocage\";'),('fr','messages:ipb-change-block','s:35: