é par {{SITENAME}}.\nVous ne pouvez pas créer un compte.\";'),('fr','messages:xffblockreason','s:165:\"Une adresse IP dans l\'en-tête X-Forwarded-For, soit la vôtre ou celle d\'un serveur proxy que vous utilisez, a été bloquée. La raison du blocage initial est : $1\";'),('fr','messages:cant-see-hidden-user','s:181:\"L’utilisateur que vous tentez de bloquer a déjà été bloqué et masqué. N’ayant pas le droit \'\'hideuser\'\', vous ne pouvez pas voir ou modifier le blocage de cet utilisateur.\";'),('fr','messages:ipbblocked','s:118:\"Vous ne pouvez pas bloquer ou débloquer d\'autres utilisateurs, parce que vous êtes vous-même bloqué{{GENDER:||e}}.\";'),('fr','messages:ipbnounblockself','s:70:\"Vous n\'êtes pas autorisé{{GENDER:||e}} à vous débloquer vous-même\";'),('fr','messages:lockdb','s:31:\"Verrouiller la base de données\";'),('fr','messages:unlockdb','s:34:\"Déverrouiller la base de données\";'),('fr','messages:lockdbtext','s:418:\"Le verrouillage de la base de données empêchera tous les utilisateurs de modifier des pages, d\'enregistrer leurs préférences, de modifier leur liste de suivi et d\'effectuer toutes les autres opérations nécessitant des changements dans la base de données.\nVeuillez confirmer que c\'est bien là ce que vous voulez faire et que vous déverrouillerez la base dès que votre opération de maintenance sera terminée.\";'),('fr','messages:unlockdbtext','s:335:\"Le déverrouillage de la base de données permettra à nouveau à tous les utilisateurs de modifier des pages, de changer leurs préférences, de modifier leur liste de suivi et d’effectuer les autres opérations nécessitant des changements dans la base de données.\nVeuillez confirmer que c’est bien là ce que vous voulez faire.\";'),('fr','messages:lockconfirm','s:65:\"Oui, je confirme que je souhaite verrouiller la base de données.\";'),('fr','messages:unlockconfirm','s:68:\"Oui, je confirme que je souhaite déverrouiller la base de données.\";'),('fr','messages:lockbtn','s:31:\"Verrouiller la base de données\";'),('fr','messages:unlockbtn','s:34:\"Déverrouiller la base de données\";'),('fr','messages:locknoconfirm','s:47:\"Vous n\'avez pas coché la case de confirmation.\";'),('fr','messages:lockdbsuccesssub','s:43:\"Verrouillage de la base de données réussi\";'),('fr','messages:unlockdbsuccesssub','s:45:\"Verrouillage de la base de données supprimé\";'),('fr','messages:lockdbsuccesstext','s:164:\"La base de données a été verrouillée.<br />\nN\'oubliez pas de la [[Special:UnlockDB|déverrouiller]] lorsque vous aurez terminé votre opération de maintenance.\";'),('fr','messages:unlockdbsuccesstext','s:44:\"La base de données a été déverrouillée.\";'),('fr','messages:lockfilenotwritable','s:166:\"Le fichier de verrouillage de la base de données n\'est pas inscriptible.\nPour bloquer ou débloquer la base de données, il doit être accessible par le serveur web.\";'),('fr','messages:databasenotlocked','s:43:\"La base de données n\'est pas verrouillée.\";'),('fr','messages:lockedbyandtime','s:20:\"(par $1 le $2 à $3)\";'),('fr','messages:move-page','s:11:\"Renommer $1\";'),('fr','messages:move-page-legend','s:17:\"Renommer une page\";'),('fr','messages:movepagetext','s:1044:\"Utilisez le formulaire ci-dessous pour renommer une page, en déplaçant tout son historique vers le nouveau nom. L\'ancien titre deviendra une page de redirection vers le nouveau titre. Vous pouvez mettre à jour automatiquement les redirections actuelles qui pointent vers le titre original. Si vous choisissez de ne pas le faire, assurez-vous de vérifier toute [[Special:DoubleRedirects|double redirection]] ou [[Special:BrokenRedirects|redirection cassée]]. Vous avez la responsabilité de vous assurer que les liens continuent de pointer vers leur destination supposée.\n\nNotez que la page ne sera \'\'\'pas\'\'\' renommée s\'il existe déjà une page avec le nouveau titre, sauf si cette dernière est une simple redirection avec un historique de modifications vierge. Ceci permet de renommer une page vers sa position d\'origine si le déplacement s\'avère erroné.\n\n\'\'\'Attention !\'\'\'\nCeci peut provoquer un changement radical et imprévu pour une page souvent consultée ; assurez-vous d\'en avoir compris les conséquences avant de continuer.\";'),('fr','messages:movepagetext-noredirectfixer','s:962:\"Utilisez le formulaire ci-dessous pour renommer une page, en déplaçant tout son historique vers le nouveau nom.\nL\'ancien titre deviendra une page de redirection vers le nouveau titre.\nVérifiez bien les [[Special:DoubleRedirects|doubles redirections]] ou les [[Special:BrokenRedirects|redirections cassées]].\nVous avez la responsabilité de vous assurer que les liens continuent de pointer vers leur destination supposée.\n\nNotez que la page ne sera \'\'\'pas\'\'\' déplacée s\'il existe déjà une page avec le nouveau titre, sauf si cette dernière a un historique de modifications vierge et est soit vide, soit une simple redirection. Ceci permet de renommer une page vers sa position d\'origine si le déplacement s\'avère erroné, et il est impossible d\'écraser une page existante.\n\n\'\'\'Attention !\'\'\'\nCeci peut provoquer un changement radical et imprévu pour une page souvent consultée ; assurez-vous d\'en avoir compris les conséquences avant de continuer.\";'),('fr','messages:movepagetalktext','s:372:\"La page de discussion associée, si présente, sera automatiquement renommée \'\'\'sauf si :\'\'\'\n* vous déplacez la page vers un autre espace de noms, ou\n* une page de discussion non vide existe déjà sous le nouveau nom, ou\n* vous décochez la case ci-dessous.\n\nDans ces cas-là, vous devrez renommer ou fusionner cette page de discussion manuellement si vous le désirez.\";'),('fr','messages:movearticle','s:18:\"Renommer la page :\";'),('fr','messages:moveuserpage-warning','s:184:\"\'\'\'Attention :\'\'\' Vous êtes sur le point de renommer une page d’utilisateur. Veuillez noter que seule la page sera renommée et que l’utilisateur \'\'\'ne\'\'\' sera \'\'\'pas\'\'\' renommé.\";'),('fr','messages:movecategorypage-warning','s:246:\"<strong>Avertissement :</strong> Vous êtes sur le point de renommer une page de catégorie. Veuillez noter que seule la catégorie sera renommée et <em>qu’aucune</em> des pages de l’ancienne catégorie ne sera transférée dans la nouvelle.\";'),('fr','messages:movenologintext','s:163:\"Pour pouvoir renommer une page, vous devez être [[Special:UserLogin|identifié{{GENDER:||e}}]] avec un compte utilisateur enregistré et d\'ancienneté suffisante.\";'),('fr','messages:movenotallowed','s:52:\"Vous n\'avez pas la permission de renommer les pages.\";'),('fr','messages:movenotallowedfile','s:55:\"Vous n\'avez pas la permission de renommer les fichiers.\";'),('fr','messages:cant-move-user-page','s:83:\"Vous n’avez pas la permission de renommer les pages principales d’utilisateurs.\";'),('fr','messages:cant-move-to-user-page','s:116:\"Vous n’avez pas la permission de renommer une page vers une page utilisateur (à l’exception d’une sous-page).\";'),('fr','messages:cant-move-category-page','s:62:\"Vous n\'avez pas la permis de renommer les pages de catégorie.\";'),('fr','messages:cant-move-to-category-page','s:79:\"Vous n\'avez pas la permission de renommer une page vers une page de catégorie.\";'),('fr','messages:newtitle','s:23:\"Vers le nouveau titre :\";'),('fr','messages:move-watch','s:38:\"Suivre les pages originale et nouvelle\";'),('fr','messages:movepagebtn','s:16:\"Renommer la page\";'),('fr','messages:pagemovedsub','s:17:\"Renommage réussi\";'),('fr','messages:movepage-moved','s:44:\"\'\'\'« $1 » a été renommée en « $2 »\'\'\'\";'),('fr','messages:movepage-moved-redirect','s:52:\"Une redirection depuis l\'ancien nom a été créée.\";'),('fr','messages:movepage-moved-noredirect','s:68:\"La création d\'une redirection depuis l\'ancien nom a été annulée.\";'),('fr','messages:articleexists','s:125:\"Il existe déjà une page portant ce titre, ou le titre que vous avez choisi n\'est pas correct.\nVeuillez en choisir u