nvoyer un code de confirmation\";'),('fr','messages:confirmemail_sent','s:32:\"Courriel de confirmation envoyé\";'),('fr','messages:confirmemail_oncreate','s:201:\"Un code de confirmation a été envoyé à votre adresse de courriel.\nCe code n’est pas requis pour vous identifier sur ce wiki, mais vous devrez le fournir pour activer toute fonction de messagerie.\";'),('fr','messages:confirmemail_sendfailed','s:233:\"{{SITENAME}} n’a pas pu vous envoyer le courriel de confirmation.\nVeuillez vérifiez que votre adresse de courriel ne comprend aucun caractère incorrect.\n\nLe programme d’envoi de courriel a retourné l’indication suivante : $1\";'),('fr','messages:confirmemail_invalid','s:62:\"Code de confirmation incorrect.\nCelui-ci a peut-être expiré.\";'),('fr','messages:confirmemail_needlogin','s:60:\"Vous devez vous $1 pour confirmer votre adresse de courriel.\";'),('fr','messages:confirmemail_success','s:143:\"Votre adresse de courriel a été confirmée.\nVous pouvez maintenant vous [[Special:UserLogin|{{MediaWiki:Loginreqlink}}]] et profiter du wiki.\";'),('fr','messages:confirmemail_loggedin','s:52:\"Votre adresse de courriel est maintenant confirmée.\";'),('fr','messages:confirmemail_subject','s:54:\"Confirmation d’adresse de courriel pour {{SITENAME}}\";'),('fr','messages:confirmemail_body','s:545:\"Quelqu’un, probablement vous, à partir de l’adresse IP $1,\na enregistré un compte « $2 » avec cette adresse de courriel\nsur le site {{SITENAME}}.\n\nPour confirmer que ce compte vous appartient vraiment et afin\nd’activer les fonctions de messagerie sur {{SITENAME}},\nveuillez suivre ce lien dans votre navigateur :\n\n$3\n\nSi vous n’avez *pas* enregistré ce compte, n’ouvrez pas ce lien ;\nvous pouvez suivre l’autre lien ci-dessous pour annuler la\nconfirmation de votre adresse courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),('fr','messages:confirmemail_body_changed','s:548:\"Quelqu’un, probablement vous, à partir de l’adresse IP $1,\na modifié l’adresse de courriel associée au compte « $2 » de {{SITENAME}}\nen cette adresse.\n\nPour confirmer que ce compte vous appartient vraiment et afin\nde réactiver les fonctions de messagerie sur {{SITENAME}},\nveuillez suivre ce lien dans votre navigateur :\n\n$3\n\nSi ce compte ne vous appartient *pas*, n’ouvrez pas ce lien ;\nvous pouvez suivre l’autre lien ci-dessous pour annuler la\nconfirmation de votre adresse courriel :\n\n$5\n\nCe code de confirmation expirera le $4.\";'),('fr','messages:confirmemail_body_set','s:462:\"Quelqu’un, probablement vous, depuis l’adresse IP $1, a modifié l’adresse de courriel du compte « $2 » en celle-ci sur {{SITENAME}}.\n\nPour confirmer que ce compte vous appartient et réactiver les fonctions de courriel sur {{SITENAME}}, ouvrez ce lien dans votre navigateur Web :\n\n$3\n\nCe code de confirmation expirera le $4.\n\nSi le compte ne vous appartient *pas*, suivez plutôt ce lien pour annuler la confirmation de l’adresse de courriel :\n\n$5\";'),('fr','messages:confirmemail_invalidated','s:45:\"Confirmation de l’adresse courriel annulée\";'),('fr','messages:invalidateemail','s:48:\"Annuler la confirmation de l\'adresse de courriel\";'),('fr','messages:scarytranscludedisabled','s:44:\"[La transclusion interwiki est désactivée]\";'),('fr','messages:scarytranscludefailed','s:49:\"[La récupération de modèle a échoué pour $1]\";'),('fr','messages:scarytranscludefailed-httpstatus','s:61:\"[Échec de la récupération du modèle pour  $1 : HTTP  $2 ]\";'),('fr','messages:scarytranscludetoolong','s:23:\"[L\'URL est trop longue]\";'),('fr','messages:deletedwhileediting','s:95:\"\'\'\'Attention\'\'\' : cette page a été supprimée après que vous ayez commencé à la modifier !\";'),('fr','messages:confirmrecreate','s:234:\"L’utilisateur [[User:$1|$1]] ([[User talk:$1|Discussion]]) a supprimé cette page, alors que vous aviez commencé à la modifier, pour le motif suivant :\n: \'\'$2\'\'\nVeuillez confirmer que vous désirez réellement recréer cette page.\";'),