'expansion de pratiquement tout ce qui est encadré par des doubles accolades.\";'),('fr','messages:expand_templates_title','s:61:\"Titre de la page, si le code utilise {{FULLPAGENAME}}, etc. :\";'),('fr','messages:expand_templates_input','s:19:\"Texte wiki source :\";'),('fr','messages:expand_templates_output','s:34:\"Texte wiki obtenu après expansion\";'),('fr','messages:expand_templates_xml_output','s:54:\"Résultat intermédiaire de l’analyse, au format XML\";'),('fr','messages:expand_templates_html_output','s:19:\"Sortie en HTML brut\";'),('fr','messages:expand_templates_ok','s:7:\"Valider\";'),('fr','messages:expand_templates_remove_comments','s:26:\"Supprimer les commentaires\";'),('fr','messages:expand_templates_remove_nowiki','s:49:\"Supprime les marqueurs <nowiki> dans le résultat\";'),('fr','messages:expand_templates_generate_xml','s:37:\"Voir l’arborescence d’analyse XML\";'),('fr','messages:expand_templates_generate_rawhtml','s:21:\"Afficher le HTML brut\";'),('fr','messages:expand_templates_preview','s:16:\"Aperçu du rendu\";'),('fr','messages:expand_templates_preview_fail_html','s:365:\"<em>Comme {{SITENAME}} a HTML brut activé et qu’il y a eu une perte de données de session, l’aperçu est masqué par précaution contre les attaques JavaScript.</em>\n\n<strong>Si c’est une demande d’aperçu légitime, veuillez réessayer.</strong>\nSi cela ne fonctionne toujours pas, essayez de [[Special:UserLogout|vous déconnecter]] et vous reconnecter.\";'),('fr','messages:expand_templates_preview_fail_html_anon','s:281:\"<em>Comme {{SITENAME}} a HTML brut activé et que vous n’êtes pas connecté, l’aperçu est masqué par précaution contre les attaques JavaScript.</em>\n\n<strong>Si c’est une demande d’aperçu légitime, veuillez [[Special:UserLogin|vous connecter]] et réessayer.</strong>\";'),('fr','messages:pagelanguage','s:31:\"Sélecteur de langue de la page\";'),('fr','messages:pagelang-name','s:4:\"Page\";'),('fr','messages:pagelang-language','s:6:\"Langue\";'),('fr','messages:pagelang-use-default','s:30:\"Utiliser la langue par défaut\";'),('fr','messages:pagelang-select-lang','s:23:\"Sélectionner la langue\";'),('fr','messages:right-pagelang','s:28:\"Changer la langue de la page\";'),('fr','messages:action-pagelang','s:28:\"changer la langue de la page\";'),('fr','messages:log-name-pagelang','s:32:\"Tracer les changements de langue\";'),('fr','messages:log-description-pagelang','s:63:\"Ceci est un journal des changements dans les langues des pages.\";'),('fr','messages:logentry-pagelang-pagelang','s:63:\"$1 {{GENDER:$2|a changé}} la langue de la page $3 de $4 à $5.\";'),('fr','messages:default-skin-not-found','s:2013:\"Oups ! L’habillage par défaut pour votre wiki, défini par <code dir=\"ltr\">$wgDefaultSkin</code> comme <code>$1</code>, n’est pas disponible.\n\nVotre installation semble inclure {{PLURAL:$4|l’habillage suivant|les habillages suivants}}. Voyez [https://www.mediawiki.org/wiki/Manual:Skin_configuration le manuel de configuration des habillages] pour savoir comment {{PLURAL:$4|l’|les }}activer et choisir celui par défaut.\n\n$2\n\n; Si vous venez juste d’installer MediaWiki :\n: Vous l’avez probablement installé depuis git, ou directement depuis le code source avec une autre méthode. C’est normal. Essayez d’installer des habillages depuis [https://www.mediawiki.org/wiki/Category:All_skins le répertoire des habillages de mediawiki.org], en:\n:* Téléchargeant le [https://www.mediawiki.org/wiki/Download fichier tar de l’installeur], qui comprend plusieurs habillages et extensions. Vous pouvez copier et coller le répertoire <code>skins/</code> depuis là.\n:* Téléchargeant les fichiers tar d’habillage individuel depuis [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Téléchargeant des habillages avec Git].\n: Faire ainsi ne devrait pas interférer avec votre dépôt git, si vous êtes un développeur de MediaWiki.\n\n; Si vous venez juste de mettre à jour MediaWiki :\n: MediaWiki 1.24 et au-delà n’active plus automatiquement les habillages installés (voyez [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery le manuel sur la découverte automatique des habillages]). Vous pouvez coller {{PLURAL:$5|la ligne suivante|les lignes suivantes}} dans <code>LocalSettings.php</code> pour activer {{PLURAL:$5|l’habillage actuellement installé|tous les habillages actuellement installés}} :\n\n<pre dir=\"ltr\">$3</pre>\n\n; Si vous venez de modifier <code>LocalSettings.php</code> :\n: Vérifiez deux fois le nom des habillages pour éviter les erreurs de frappe.\";'),('fr','messages:default-skin-not-found-no-skins','s:1422:\"Oups ! L’habillage par défaut pour votre wiki , défini par <code>$wgDefaultSkin</code> comme <code>$1</code>, n’est pas disponible.\n\nVous n’avez aucun habillage d’installé.\n\n; Si vous venez juste d’installer ou de mettre à jour MediaWiki :\n: Vous l’avez sans doute fait depuis git, ou directement depuis le code source avec une autre méthode. C’est normal. MediaWiki 1.24 et au-delà n’inclut aucun habillage dans le dépôt principal. Essayez d’installer des habillages depuis [https://www.mediawiki.org/wiki/Category:All_skins le répertoire des habillages de mediawiki.org], en :\n:* Téléchargeant [https://www.mediawiki.org/wiki/Download le fichier tar de l’installeur], qui comprend différents habillages et extensions. Vous pouvez copier et coller le répertoire <code>skins/</code> depuis là.\n:* Téléchargeant les fichiers tar d’habillage individuel depuis [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Utiliser Git pour télécharger des habillages].\n: Faire ainsi ne devrait pas interférer avec votre dépôt git si vous êtes un développeur de MediaWiki. Voyez [https://www.mediawiki.org/wiki/Manual:Skin_configuration le manuel de la configuration des habillages] pour des instructions sur la manière d’activer les habillages et choisir celui par défaut.\";'),('fr','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (activé)\";'),('fr','messages:default-skin-not-found-row-disabled','s:42:\"* <code>$1</code> / $2 (\'\'\'désactivé\'\'\')\";'),('fr','messages:mediastatistics','s:28:\"Statistiques sur les médias\";'),('fr','messages:mediastatistics-summary','s:194:\"Statistiques sur les types de fichier téléchargés. Elles ne prennent en compte que la version la plus récente d’un fichier. Les versions anciennes ou supprimées des fichiers sont exclues.\";'),('fr','messages:mediastatistics-nbytes','s:45:\"{{PLURAL:$1|$1 octet|$1 octets}} ($2 ; $3%)\";'),('fr','messages:mediastatistics-table-mimetype','s:9:\"Type MIME\";'),('fr','messages:mediastatistics-table-extensions','s:20:\"Extensions possibles\";'),('fr','messages:mediastatistics-table-count','s:18:\"Nombre de fichiers\";'),('fr','messages:mediastatistics-table-totalbytes','s:16:\"Taille combinée\";'),('fr','messages:mediastatistics-header-unknown','s:7:\"Inconnu\";'),('fr','messages:mediastatistics-header-bitmap','s:13:\"Images raster\";'),('fr','messages:mediastatistics-header-drawing','s:29:\"Dessins (images vectorielles)\";'),('fr','messages:mediastatistics-header-audio','s:5:\"Audio\";'),('fr','messages:mediastatistics-header-video','s:7:\"Vidéos\";'),('fr','messages:mediastatistics-header-multimedia','s:12:\"Média riche\";'),('fr','messages:mediastatistics-header-office','s:11:\"Bureautique\";'),('fr','messages:mediastatistics-header-text','s:7:\"Textuel\";'),('fr','messages:mediastatistics-header-executable','s:12:\"Exécutables\";'),('fr','messages:mediastatistics-header-archive','s:19:\"Formats compressés\";'),('fr','messages:json-warn-trailing-comma','s:97:\"$1 {{PLURAL:$1|virgule finale a été supprimée|virgules finales ont été supprimées}} du JSON\";'),('fr','messages:json-error-unknown','s:48:\"Il y a eu un problème avec le JSON. Erreur : $1\";'),('fr','messages:json-error-depth','s:48:\"La taille maximale de la pile a été dépassée\";'),('fr','messages:json-error-state-mismatch','s:29:\"JSON non valide ou mal formé\";'),('fr','messages:json-error-ctrl-char','s:58:\"Erreur de caractères de contrôle, peut-être mal encodé\";'),('fr','messages:json-error-syntax','s:17:\"Erreur de syntaxe\";'),('fr','messages:json-error-utf8','s:53:\"Caractères UTF-8 mal formés, peut-être mal encodé\";'),('fr','messages:json-error-recursion','s:67:\"Une ou plusieurs références récursives dans la valeur à encoder\";'),('fr','messages:json-error-inf-or-nan','s:62:\"Une une plusieurs valeurs NaN ou INF dans la valeur à encoder\";'),('fr','messages:json-error-unsupported-type','s:68:\"Une valeur a été donnée dans un type ne pouvant pas être encodé\";'),('fr','messages:headline-anchor-title','s:23:\"Lien vers cette section\";'),('fr','messages:special-characters-group-latin','s:5:\"latin\";'),('fr','messages:special-characters-group-latinextended','s:13:\"latin étendu\";'),('fr','messages:special-characters-group-ipa','s:3:\"API\";'),('fr','messages:special-characters-group-symbols','s:8:\"symboles\";'),('fr','messages:special-characters-group-greek','s:4:\"grec\";'),('fr','messages:special-characters-group-cyrillic','s:10:\"cyrillique\";'),('fr','messages:special-characters-group-arabic','s:5:\"arabe\";'),('fr','messages:special-characters-group-arabicextended','s:13:\"arabe étendu\";'),('fr','messages:special-characters-group-persian','s:6:\"persan\";'),('fr','messages:special-characters-group-hebrew','s:7:\"hébreu\";'),('fr','messages:special-characters-group-bangla','s:8:\"bengalî\";'),('fr','messages:special-characters-group-tamil','s:6:\"tamoul\";'),('fr','messages:special-characters-group-telugu','s:9:\"télougou\";'),('fr','messages:special-characters-group-sinhala','s:9:\"cingalais\";'),('fr','messages:special-characters-group-gujarati','s:10:\"gujarâtî\";'),('fr','messages:special-characters-group-devanagari','s:11:\"dévanagari\";'),('fr','messages:special-characters-group-thai','s:5:\"thaï\";'),('fr','messages:special-characters-group-lao','s:7:\"laotien\";'),('fr','messages:special-characters-group-khmer','s:5:\"khmer\";'),('fr','messages:special-characters-title-endash','s:19:\"tiret demi-cadratin\";'),('fr','messages:special-characters-title-emdash','s:14:\"tiret cadratin\";'),('fr','messages:special-characters-title-minus','s:11:\"signe moins\";'),('fr','messages:mw-widgets-dateinput-no-date','s:26:\"Aucune date sélectionnée\";'),('fr','messages:mw-widgets-dateinput-placeholder-day','s:10:\"AAAA-MM-JJ\";'),('fr','messages:mw-widgets-dateinput-placeholder-month','s:7:\"AAAA-MM\";'),('fr','messages:mw-widgets-titleinput-description-new-page','s:29:\"la page n’existe pas encore\";'),('fr','messages:mw-widgets-titleinput-description-redirect','s:19:\"redirection vers $1\";'),('fr','messages:apihelp-main-description','s:1067:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:API:Main_page|Documentation]]\n* [[mw:API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Liste de diffusion]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce Annonces de l’API]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bogues et demandes]\n</div>\n<strong>État :</strong> Toutes les fonctionnalités affichées sur cette page devraient fonctionner, mais l’API est encore en cours de développement et peut changer à tout moment. Inscrivez-vous à [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ la liste de diffusion mediawiki-api-announce] pour être informé des mises à jour.\n\n<strong>Requêtes erronées :</strong> Si des requêtes erronées sont envoyées à l’API, un en-tête HTTP sera renvoyé avec la clé « MediaWiki-API-Error ». La valeur de cet en-tête et le code d’erreur renvoyé prendront la même valeur. Pour plus d’information, voyez [[mw:API:Errors_and_warnings|API: Errors and warnings]].\";'),('fr','messages:apihelp-main-param-action','s:24:\"Quelle action effectuer.\";'),('fr','messages:apihelp-main-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-main-param-maxlag','s:594:\"La latence maximale peut être utilisée quand MédiaWiki est installé sur un cluster de base de données répliqué. Pour éviter des actions provoquant un supplément de latence de réplication de site, ce paramètre peut faire attendre le client jusqu’à ce que la latence de réplication soit inférieure à une valeur spécifiée. En cas de latence excessive, le code d’erreur <samp>maxlag</samp> est renvoyé avec un message tel que <samp>Attente de $host : $lag secondes de délai</samp>.<br />Voyez [[mw:Manual:Maxlag_parameter|Manuel: Maxlag parameter]] pour plus d’information.\";'),('fr','messages:apihelp-main-param-smaxage','s:135:\"Fixer l’entête HTTP de contrôle de cache <code>s-maxage</code> à ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-maxage','s:134:\"Fixer l’entête HTTP de contrôle de cache <code>max-age</code> à ce nombre de secondes. Les erreurs ne sont jamais mises en cache.\";'),('fr','messages:apihelp-main-param-assert','s:143:\"Vérifier si l’utilisateur est connecté si positionné à <kbd>user</kbd>, ou a le droit utilisateur robot si positionné à <kbd>bot</kbd>.\";'),('fr','messages:apihelp-main-param-requestid','s:105:\"Toute valeur fournie ici sera incluse dans la réponse. Peut être utilisé pour distinguer des demandes.\";'),('fr','messages:apihelp-main-param-servedby','s:72:\"Inclure le nom d’hôte qui a renvoyé la requête dans les résultats.\";'),('fr','messages:apihelp-main-param-curtimestamp','s:48:\"Inclure l’horodatage actuel dans le résultat.\";'),('fr','messages:apihelp-main-param-origin','s:762:\"En accédant à l’API en utilisant une requête AJAX inter-domaines (CORS), mettre le domaine d’origine dans ce paramètre. Il doit être inclus dans toute requête de pre-flight, et doit donc faire partie de l’URI de la requête (pas du corps du POST). Il doit correspondre exactement à une des origines dans l’entête <code>Origin</code> header, donc il doit être fixé avec quelque chose comme <kbd>https://en.wikipedia.org</kbd> ou <kbd>https://meta.wikimedia.org</kbd>. Si ce paramètre ne correspond pas à l’entête <code>Origin</code>, une réponse 403 sera renvoyée. Si ce paramètre correspond à l’entête <code>Origin</code> et que l’origine est en liste blanche, un entête <code>Access-Control-Allow-Origin</code> sera positionné.\";'),('fr','messages:apihelp-main-param-uselang','s:391:\"Langue à utiliser pour les traductions de message. Une liste de codes peut être analysée depuis <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> avec <kbd>siprop=languages</kbd>, ou en spécifiant <kbd>user</kbd> pour utiliser la préférence de langue de l’utilisateur actuel, ou en spécifiant <kbd>content</kbd> pour utiliser le langage du contenu de ce wiki.\";'),('fr','messages:apihelp-block-description','s:23:\"Bloquer un utilisateur.\";'),('fr','messages:apihelp-block-param-user','s:81:\"Nom d’utilisateur, adresse IP ou plage d’adresses IP que vous voulez bloquer.\";'),('fr','messages:apihelp-block-param-expiry','s:264:\"Durée d’expiration. Peut être relative (par ex. <kbd>5 months</kbd> ou <kbd>2 weeks</kbd>) ou absolue (par ex. <kbd>2014-09-18T12:34:56Z</kbd>). Si elle est mise à <kbd>infinite</kbd>, <kbd>indefinite</kbd> ou <kbd>never</kbd>, le blocage n’expirera jamais.\";'),('fr','messages:apihelp-block-param-reason','s:17:\"Motif du blocage.\";'),('fr','messages:apihelp-block-param-anononly','s:124:\"Bloquer uniquement les utilisateurs anonymes (c’est-à-dire désactiver les modifications anonymes pour cette adresse IP).\";'),('fr','messages:apihelp-block-param-nocreate','s:33:\"Empêcher la création de compte.\";'),('fr','messages:apihelp-block-param-autoblock','s:148:\"Bloquer automatiquement la dernière adresse IP utilisée, et toute les adresses IP subséquentes depuis lesquelles ils ont essayé de se connecter.\";'),('fr','messages:apihelp-block-param-noemail','s:109:\"Empêcher l’utilisateur d’envoyer des courriels via le wiki (nécessite le doit <code>blockemail</code>).\";'),('fr','messages:apihelp-block-param-hidename','s:106:\"Masque le nom de l’utilisateur dans le journal des blocages (nécessite le droit <code>hideuser</code>).\";'),('fr','messages:apihelp-block-param-allowusertalk','s:150:\"Autoriser les utilisateurs à modifier leur propre page de discussion (dépend de <var>[[mw:Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('fr','messages:apihelp-block-param-reblock','s:68:\"Si l’utilisateur est déjà bloqué, écraser le blocage existant.\";'),('fr','messages:apihelp-block-param-watchuser','s:90:\"Surveiller les pages utilisateur et de discussion de l’utilisateur ou de l’adresse IP.\";'),('fr','messages:apihelp-block-example-ip-simple','s:108:\"Bloquer l’adresse IP <kbd>192.0.2.5</kbd> pour trois jours avec le motif <kbd>Premier avertissement</kbd>.\";'),('fr','messages:apihelp-block-example-user-complex','s:161:\"Bloquer indéfiniment l’utilisateur <kbd>Vandale</kbd> avec le motif <kbd>Vandalisme</kbd>, et empêcher la création de nouveau compte et l\'envoi de courriel.\";'),('fr','messages:apihelp-checktoken-description','s:106:\"Vérifier la validité d\'un jeton de <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('fr','messages:apihelp-checktoken-param-type','s:20:\"Type de jeton testé\";'),('fr','messages:apihelp-checktoken-param-token','s:16:\"Jeton à tester.\";'),('fr','messages:apihelp-checktoken-param-maxtokenage','s:50:\"Temps maximum autorisé pour le jeton, en secondes\";'),('fr','messages:apihelp-checktoken-example-simple','s:50:\"Tester la validité d\'un jeton de <kbd>csrf</kbd>.\";'),('fr','messages:apihelp-clearhasmsg-description','s:67:\"Efface le drapeau <code>hasmsg</code> pour l’utilisateur courant.\";'),('fr','messages:apihelp-clearhasmsg-example-1','s:67:\"Effacer le drapeau <code>hasmsg</code> pour l’utilisateur courant\";'),('fr','messages:apihelp-compare-description','s:165:\"Obtenir la différence entre 2 pages.\n\nVous devez passer un numéro de révision, un titre de page, ou un ID de page, à la fois pour « from » et « to ».\";'),('fr','messages:apihelp-compare-param-fromtitle','s:26:\"Premier titre à comparer.\";'),('fr','messages:apihelp-compare-param-fromid','s:36:\"ID de la première page à comparer.\";'),('fr','messages:apihelp-compare-param-fromrev','s:32:\"Première révision à comparer.\";'),('fr','messages:apihelp-compare-param-totitle','s:25:\"Second titre à comparer.\";'),('fr','messages:apihelp-compare-param-toid','s:34:\"ID de la seconde page à comparer.\";'),('fr','messages:apihelp-compare-param-torev','s:30:\"Seconde révision à comparer.\";'),('fr','messages:apihelp-compare-example-1','s:50:\"Créer une différence entre les révisions 1 et 2\";'),('fr','messages:apihelp-createaccount-description','s:37:\"Créer un nouveau compte utilisateur.\";'),('fr','messages:apihelp-createaccount-param-name','s:20:\"Nom d’utilisateur.\";'),('fr','messages:apihelp-createaccount-param-password','s:64:\"Mot de passe (ignoré si <var>$1mailpassword</var> est défini).\";'),('fr','messages:apihelp-createaccount-param-domain','s:55:\"Domaine pour l’authentification externe (facultatif).\";'),('fr','messages:apihelp-createaccount-param-token','s:61:\"Jeton de création de compte obtenu à la première requête.\";'),('fr','messages:apihelp-createaccount-param-email','s:52:\"Adresse de courriel de l’utilisateur (facultatif).\";'),('fr','messages:apihelp-createaccount-param-realname','s:41:\"Vrai nom de l’utilisateur (facultatif).\";'),('fr','messages:apihelp-createaccount-param-mailpassword','s:115:\"S’il est fixé à une valeur quelconque, un mot de passe aléatoire sera envoyé par courriel à l’utilisateur.\";'),('fr','messages:apihelp-createaccount-param-reason','s:68:\"Motif facultatif de création du compte à mettre dans les journaux.\";'),('fr','messages:apihelp-createaccount-param-language','s:102:\"Code de langue à mettre par défaut pour l’utilisateur (facultatif, par défaut langue du contenu).\";'),('fr','messages:apihelp-createaccount-example-pass','s:83:\"Créer l’utilisateur <kbd>testuser</kbd> avec le mot de passe <kbd>test123</kbd>.\";'),('fr','messages:apihelp-createaccount-example-mail','s:112:\"Créer l’utilisateur <kbd>testmailuser</kbd> et envoyer par courriel un mot de passe généré aléatoirement.\";'),('fr','messages:apihelp-delete-description','s:19:\"Supprimer une page.\";'),('fr','messages:apihelp-delete-param-title','s:96:\"Titre de la page que vous voulez supprimer. Impossible de l’utiliser avec <var>$1pageid</var>.\";'),('fr','messages:apihelp-delete-param-pageid','s:88:\"ID de la page que vous voulez supprimer. Impossible à utiliser avec <var>$1title</var>.\";'),('fr','messages:apihelp-delete-param-reason','s:87:\"Motif de suppression. Si non défini, un motif généré automatiquement sera utilisé.\";'),('fr','messages:apihelp-delete-param-watch','s:63:\"Ajouter la page à la liste de suivi de l’utilisateur actuel.\";'),('fr','messages:apihelp-delete-param-watchlist','s:147:\"Ajouter ou supprimer sans distinction la page de la liste de suivi de l\'utilisateur actuel, utiliser les préférences ou ne rien changer au suivi.\";'),('fr','messages:apihelp-delete-param-unwatch','s:63:\"Supprimer la page de la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-delete-param-oldimage','s:144:\"Le nom de l’ancienne image à supprimer tel que fourni par [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('fr','messages:apihelp-delete-example-simple','s:37:\"Supprimer <kbd>Page principale</kbd>.\";'),('fr','messages:apihelp-delete-example-reason','s:90:\"Supprimer <kbd>Page principale</kbd> avec le motif <kbd>Préparation au déplacement</kbd>\";'),('fr','messages:apihelp-disabled-description','s:30:\"Ce module a été désactivé.\";'),('fr','messages:apihelp-edit-descr