";'),('fr','messages:apihelp-login-param-name','s:20:\"Nom d’utilisateur.\";'),('fr','messages:apihelp-login-param-password','s:13:\"Mot de passe.\";'),('fr','messages:apihelp-login-param-domain','s:21:\"Domaine (facultatif).\";'),('fr','messages:apihelp-login-param-token','s:51:\"Jeton de connexion obtenu à la première requête.\";'),('fr','messages:apihelp-login-example-gettoken','s:33:\"Récupérer un jeton de connexion\";'),('fr','messages:apihelp-login-example-login','s:12:\"Se connecter\";'),('fr','messages:apihelp-logout-description','s:51:\"Se déconnecter et effacer les données de session.\";'),('fr','messages:apihelp-logout-example-logout','s:36:\"Déconnecter l’utilisateur actuel.\";'),('fr','messages:apihelp-managetags-description','s:74:\"Effectuer des tâches de gestion relatives à la modification des balises.\";'),('fr','messages:apihelp-managetags-param-operation','s:547:\"Quelle opération effectuer :\n;create:Créer une nouvelle balise de modification pour un usage manuel.\n;delete:Supprimer une balise de modification de la base de données, y compris la suppression de la marque de toutes les révisions, entrées de modification récente et entrées de journal dans lesquelles elle serait utilisée.\n;activate:Activer une balise de modification, permettant aux utilisateurs de l’appliquer manuellement.\n;deactivate:Désactiver une balise de modification, empêchant les utilisateurs de l’appliquer manuellement.\";'),('fr','messages:apihelp-managetags-param-tag','s:347:\"Balise à créer, supprimer, activer ou désactiver. Pour la création de balise, elle ne doit pas exister. Pour la suppression de balise, elle doit exister. Pour l’activation de balise, elle doit exister et ne pas être utilisée par une extension. Pour la désactivation de balise, elle doit être actuellement active et définie manuellement.\";'),('fr','messages:apihelp-managetags-param-reason','s:77:\"Un motif facultatif pour créer, supprimer, activer ou désactiver la balise.\";'),('fr','messages:apihelp-managetags-param-ignorewarnings','s:84:\"S’il faut ignorer tout avertissement qui se produirait au cours de l’opération.\";'),('fr','messages:apihelp-managetags-example-create','s:117:\"Créer une balise nommée <kbd>pourriel</kbd> avec le motif <kbd>À utiliser lors de la revue des modifications</kbd>\";'),('fr','messages:apihelp-managetags-example-delete','s:74:\"Supprimer la balise <kbd>vandlaism</kbd> avec le motif <kbd>Misspelt</kbd>\";'),('fr','messages:apihelp-managetags-example-activate','s:115:\"Activer une balise nommée <kbd>pourriel</kbd> avec le motif <kbd>À utiliser dans la revue des modifications</kbd>\";'),('fr','messages:apihelp-managetags-example-deactivate','s:92:\"Désactiver une balise nommée <kbd>pourriel</kbd> avec le motif <kbd>Plus nécessaire</kbd>\";'),('fr','messages:apihelp-move-description','s:19:\"Déplacer une page.\";'),('fr','messages:apihelp-move-param-from','s:82:\"Titre de la page à renommer. Impossible de l’utiliser avec <var>$1fromid</var>.\";'),('fr','messages:apihelp-move-param-fromid','s:73:\"ID de la page à renommer. Impossible à utiliser avec <var>$1from</var>.\";'),('fr','messages:apihelp-move-param-to','s:27:\"Titre de la page renommée.\";'),('fr','messages:apihelp-move-param-reason','s:19:\"Motif du renommage.\";'),('fr','messages:apihelp-move-param-movetalk','s:47:\"Renommer la page de discussion, si elle existe.\";'),('fr','messages:apihelp-move-param-movesubpages','s:42:\"Renommer les sous-pages, le cas échéant.\";'),('fr','messages:apihelp-move-param-noredirect','s:30:\"Ne pas créer une redirection.\";'),('fr','messages:apihelp-move-param-watch','s:77:\"Ajouter une page et la redirection à liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-move-param-unwatch','s:81:\"Supprimer la page et la redirection de la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-move-param-watchlist','s:144:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l\'utilisateur actuel, utiliser les préférences ou ne pas changer le suivi.\";'),('fr','messages:apihelp-move-param-ignorewarnings','s:32:\"Ignorer tous les avertissements.\";'),('fr','messages:apihelp-move-example-move','s:86:\"Déplacer <kbd>Mauvais titre</kbd> en <kbd>Bon titre</kbd> sans garder de redirection.\";'),('fr','messages:apihelp-opensearch-description','s:61:\"Rechercher dans le wiki en utilisant le protocole OpenSearch.\";'),('fr','messages:apihelp-opensearch-param-search','s:21:\"Chaîne de recherche.\";'),('fr','messages:apihelp-opensearch-param-limit','s:41:\"Nombre maximal de résultats à renvoyer.\";'),('fr','messages:apihelp-opensearch-param-namespace','s:29:\"Espaces de nom à rechercher.\";'),('fr','messages:apihelp-opensearch-param-suggest','s:106:\"Ne rien faire si <var>[[mw:Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> vaut faux.\";'),('fr','messages:apihelp-opensearch-param-redirects','s:289:\"Comment gérer les redirections :\n;return:Renvoie la redirection elle-même.\n;resolve:Renvoie la page cible. Peut renvoyer moins de $1limit résultats.\nPour des raisons historiques, la valeur par défaut est « return » pour $1format=json et « resolve » pour les autres formats.\";'),('fr','messages:apihelp-opensearch-param-format','s:20:\"Le format de sortie.\";'),('fr','messages:apihelp-opensearch-param-warningsaserror','s:114:\"Si des avertissements sont levés avec <kbd>format=json</kbd>, renvoyer une erreur d’API au lieu de les ignorer.\";'),('fr','messages:apihelp-opensearch-example-te','s:48:\"Trouver les pages commençant par <kbd>Te</kbd>.\";'),('fr','messages:apihelp-options-description','s:294:\"Modifier les préférences de l’utilisateur courant.\n\nSeules les options enregistrées dans le cœur ou dans l’une des extensions installées, ou les options avec des clés préfixées par <code>userjs-</code> (devant être utilisées dans les scripts utilisateur), peuvent être définies.\";'),('fr','messages:apihelp-options-param-reset','s:64:\"Réinitialise les préférences aux valeurs par défaut du site.\";'),('fr','messages:apihelp-options-param-resetkinds','s:94:\"Liste des types d’option à réinitialiser quand l’option <var>$1reset</var> est définie.\";'),('fr','messages:apihelp-options-param-change','s:285:\"Liste des modifications, au format nom=valeur (par ex. skin=vector). La valeur ne peut pas contenir de caractère barre verticale. Si aucune valeur n’est fournie (pas même un signe égal), par ex., nomoption|autreoption|…, l’option sera réinitialisée à sa valeur par défaut.\";'),('fr','messages:apihelp-options-param-optionname','s:89:\"Un nom d’option qui doit être fixé à la valeur fournie par <var>$1optionvalue</var>.\";'),('fr','messages:apihelp-options-param-optionvalue','s:111:\"La valeur d’une option spécifiée par <var>$1optionname</var> peut contenir des caractères barre verticale.\";'),('fr','messages:apihelp-options-example-reset','s:39:\"Réinitialiser toutes les préférences\";'),('fr','messages:apihelp-options-example-change','s:67:\"Modifier les préférences <kbd>skin</kbd> et <kbd>hideminor</kbd>.\";'),('fr','messages:apihelp-options-example-complex','s:94:\"Réinitialiser toutes les préférences, puis définir <kbd>skin</kbd> et <kbd>nickname</kbd>.\";'),('fr','messages:apihelp-paraminfo-description','s:52:\"Obtenir des informations sur les modules de l’API.\";'),('fr','messages:apihelp-paraminfo-param-modules','s:165:\"Liste des noms de module (valeurs des paramètres <var>action</var> et <var>format</var>, ou <kbd>main</kbd>). Peut spécifier des sous-modules avec un <kbd>+</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-helpformat','s:29:\"Format des chaînes d’aide.\";'),('fr','messages:apihelp-paraminfo-param-querymodules','s:199:\"Liste des noms de module de requêtage (valeur des paramètres <var>prop</var>, <var>meta</var> ou <var>list</var>=). Utiliser <kbd>$1modules=query+foo</kbd> au lieu de <kbd>$1querymodules=foo</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-mainmodule','s:119:\"Obtenir aussi des informations sur le module principal (niveau supérieur). Utiliser plutôt <kbd>$1modules=main</kbd>.\";'),('fr','messages:apihelp-paraminfo-param-pagesetmodule','s:90:\"Obtenir aussi des informations sur le module pageset (en fournissant titles= et ses amis).\";'),('fr','messages:apihelp-paraminfo-param-formatmodules','s:122:\"Liste des noms de module de mise en forme (valeur du paramètre <var>format</var>). Utiliser plutôt <var>$1modules</var>.\";'),('fr','messages:apihelp-paraminfo-example-1','s:284:\"Afficher les informations pour <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> et <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('fr','messages:apihelp-parse-description','s:611:\"Analyse le contenu et renvoie le résultat de l’analyseur.\n\nVoyez les différents modules prop de <kbd>[[Special:ApiHelp/query|action=query]]</kbd> pour avoir de l’information sur la version actuelle d’une page.\n\nIl y a plusieurs moyens de spécifier le texte à analyser :\n# Spécifier une page ou une révision, en utilisant <var>$1page</var>, <var>$1pageid</var> ou <var>$1oldid</var>.\n# Spécifier explicitement un contenu, en utilisant <var>$1text</var>, <var>$1title</var> et <var>$1contentmodel</var>\n# Spécifier uniquement un résumé à analyser. <var>$1prop</var> doit recevoir une valeur vide.\";'),('fr','messages:apihelp-parse-param-title','s:145:\"Titre de la page à laquelle appartient le texte. Si omis, <var>$1contentmodel</var> doit être spécifié, et [[API]] sera utilisé comme titre.\";'),('fr','messages:apihelp-parse-param-text','s:114:\"Texte à analyser. utiliser <var>$1title</var> ou <var>$1contentmodel</var> pour contrôler le modèle de contenu.\";'),('fr','messages:apihelp-parse-param-summary','s:21:\"Résumé à analyser.\";'),('fr','messages:apihelp-parse-param-page','s:103:\"Analyser le contenu de cette page. Impossible à utiliser avec <var>$1text</var> et <var>$1title</var>.\";'),('fr','messages:apihelp-parse-param-pageid','s:61:\"Analyser le contenu de cette page. Écrase <var>$1page</var>.\";'),('fr','messages:apihelp-parse-param-redirects','s:108:\"Si le paramètre <var>$1page</var> ou <var>$1pageid</var> est positionné sur une redirection, la résoudre.\";'),('fr','messages:apihelp-parse-param-oldid','s:89:\"Analyser le contenu de cette révision. Écrase <var>$1page</var> et <var>$1pageid</var>.\";'),('fr','messages:apihelp-parse-param-prop','s:30:\"Quelles informations obtenir :\";'),('fr','messages:apihelp-parse-paramvalue-prop-text','s:39:\"Fournit le texte analysé du wikitexte.\";'),('fr','messages:apihelp-parse-paramvalue-prop-langlinks','s:50:\"Fournit les liens de langue du wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-categories','s:51:\"Fournit les catégories dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:40:\"Fournit la version HTML des catégories.\";'),('fr','messages:apihelp-parse-paramvalue-prop-links','s:54:\"Fournit les liens internes dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-templates','s:48:\"Fournit les modèles dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-images','s:46:\"Fournit les images dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-externallinks','s:54:\"Fournit les liens externes dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-sections','s:48:\"Fournit les sections dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-revid','s:48:\"Ajoute l’ID de révision de la page analysée.\";'),('fr','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Ajoute le titre du wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-headitems','s:78:\"Fournit les éléments à mettre dans le <code>&lt;head&gt;</code> de la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-headhtml','s:57:\"Fournit le <code>&lt;head&gt;</code> analysé de la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-modules','s:167:\"Fournit les modules ResourceLoader utilisés sur la page. Soit <kbd>jsconfigvars</kbd> soit <kbd>encodedjsconfigvars</kbd> doit être demandé avec <kbd>modules</kbd>.\";'),('fr','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:74:\"Fournit les variables de configuration JavaScript spécifiques à la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:93:\"Fournit les variables de configuration JavaScript spécifiques à la page comme chaîne JSON.\";'),('fr','messages:apihelp-parse-paramvalue-prop-indicators','s:72:\"Fournit le HTML des indicateurs d’état de page utilisés sur la page.\";'),('fr','messages:apihelp-parse-paramvalue-prop-iwlinks','s:56:\"Fournit les liens interwikis dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-wikitext','s:54:\"Fournit le wikitexte d’origine qui a été analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-properties','s:71:\"Fournit les diverses propriétés définies dans le wikitexte analysé.\";'),('fr','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:137:\"Fournit le rapport de limite d’une manière structurée. Ne fournit aucune donnée, si <var>$1disablelimitreport</var> est positionné.\";'),('fr','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:124:\"Fournit la version HTML du rapport de limite. Ne fournit aucune donnée, si <var>$1disablelimitreport</var> est positionné.\";'),('fr','messages:apihelp-parse-paramvalue-prop-parsetree','s:103:\"L’arbre d’analyse XML du contenu de la révision (nécessite le modèle de contenu <code>$1</code>)\";'),('fr','messages:apihelp-parse-param-pst','s:131:\"Faire une transformation avant enregistrement de l’entrée avant de l’analyser. Valide uniquement quand utilisé avec du texte.\";'),('fr','messages:apihelp-parse-param-onlypst','s:216:\"Faire une transformation avant enregistrement (PST) de l’entrée, mais ne pas l’analyser. Renvoie le même wikitexte, après que la PST a été appliquée. Valide uniquement quand utilisé avec <var>$1text</var>.\";'),('fr','messages:apihelp-parse-param-effectivelanglinks','s:101:\"Inclut les liens de langue fournis par les extensions (à utiliser avec <kbd>$1prop=langlinks</kbd>).\";'),('fr','messages:apihelp-parse-param-section','s:222:\"Récupérer uniquement le contenu de ce numéro de section ou quand <kbd>nouveau</kbd> génère une nouvelle section.\n\nLa <kbd>nouvelle</kbd> section est mise à l’honneur uniquement quand <var>text</var> est spécifié.\";'),('fr','messages:apihelp-parse-param-sectiontitle','s:190:\"Nouveau titre de section quand <var>section</var> vaut <kbd>nouveau</kbd>.\n\nÀ la différence de la modification de page, cela ne revient pas à <var>summary</var> quand il est omis ou vide.\";'),('fr','messages:apihelp-parse-param-disablelimitreport','s:103:\"Omettre le rapport de limite (« rapport de limite du nouveau PP ») de la sortie de l’analyseur.\";'),('fr','messages:apihelp-parse-param-disablepp','s:53:\"Utiliser <var>$1disablelimitreport</var> à la place.\";'),('fr','messages:apihelp-parse-param-disableeditsection','s:75:\"Omettre les liens de modification de section de la sortie de l’analyseur.\";'),('fr','messages:apihelp-parse-param-disabletidy','s:99:\"Ne pas exécuter de nettoyage du code HTML (par exemple,  réagencer) sur la sortie de l\'analyseur.\";'),('fr','messages:apihelp-parse-param-generatexml','s:132:\"Générer un arbre d’analyse XML (nécessite le modèle de contenu <code>$1</code> ; remplacé par <kbd>$2prop=parsetree</kbd>).\";'),('fr','messages:apihelp-parse-param-preview','s:25:\"Analyser en mode aperçu.\";'),('fr','messages:apihelp-parse-param-sectionpreview','s:67:\"Analyser en mode aperçu de section (active aussi le mode aperçu).\";'),('fr','messages:apihelp-parse-param-disabletoc','s:46:\"Omettre la table des matières dans la sortie.\";'),('fr','messages:apihelp-parse-param-contentformat','s:114:\"Format de sérialisation du contenu utilisé pour le texte d’entrée. Valide uniquement si utilisé avec $1text.\";'),('fr','messages:apihelp-parse-param-contentmodel','s:188:\"Modèle de contenu du texte d’entrée. Si omis, $1title doit être spécifié, et la valeur par défaut sera le modèle du titre spécifié. Valide uniquement quand utilisé avec $1text.\";'),('fr','messages:apihelp-parse-example-page','s:18:\"Analyser une page.\";'),('fr','messages:apihelp-parse-example-text','s:22:\"Analyser le wikitexte.\";'),('fr','messages:apihelp-parse-example-texttitle','s:58:\"Analyser du wikitexte, en spécifiant le titre de la page.\";'),('fr','messages:apihelp-parse-example-summary','s:21:\"Analyser un résumé.\";'),('fr','messages:apihelp-patrol-description','s:38:\"Patrouiller une page ou une révision.\";'),('fr','messages:apihelp-patrol-param-rcid','s:43:\"ID de modification récente à patrouiller.\";'),('fr','messages:apihelp-patrol-param-revid','s:31:\"ID de révision à patrouiller.\";'),('fr','messages:apihelp-patrol-example-rcid','s:37:\"Patrouiller une modification récente\";'),('fr','messages:apihelp-patrol-example-revid','s:25:\"Patrouiller une révision\";'),('fr','messages:apihelp-protect-description','s:46:\"Modifier le niveau de protection d’une page.\";'),('fr','messages:apihelp-protect-param-title','s:73:\"Titre de la page à (dé)protéger. Impossible à utiliser avec $1pageid.\";'),('fr','messages:apihelp-protect-param-pageid','s:69:\"ID de la page à (dé)protéger. Impossible à utiliser avec $1title.\";'),('fr','messages:apihelp-protect-param-protections','s:194:\"Liste des niveaux de protection, au format <kbd>action=niveau</kbd> (par ex. <kbd>edit=sysop</kbd>).\n\n<strong>NOTE :<strong> Toutes les actions non listées auront leur restrictions supprimées.\";'),('fr','messages:apihelp-protect-param-expiry','s:237:\"Horodatages d’expiration. Si un seul horodatage est fourni, il sera utilisé pour toutes les protections. Utiliser <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> ou <kbd>never</kbd> pour une protection sans expiration.\";'),('fr','messages:apihelp-protect-param-reason','s:25:\"Motif de (dé)protection.\";'),('fr','messages:apihelp-protect-param-cascade','s:208:\"Activer la protection en cascade (c’est-à-dire protéger les modèles transclus et les images utilisées dans cette page). Ignoré si aucun des niveaux de protection fournis ne supporte la mise en cascade.\";'),('fr','messages:apihelp-protect-param-watch','s:89:\"Si activé, ajouter la page (dé)protégée à la liste de suivi de l\'utilisateur actuel.\";'),('fr','messages:apihelp-protect-param-watchlist','s:145:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l\'utilisateur actuel, utiliser les préférences ou ne pas modifier le suivi.\";'),('fr','messages:apihelp-protect-example-protect','s:18:\"Protéger une page\";'),('fr','messages:apihelp-protect-example-unprotect','s:81:\"Enlever la protection d’une page en mettant les restrictions à <kbd>all</kbd>.\";'),('fr','messages:apihelp-protect-example-unprotect2','s:65:\"Enlever la protection de la page en ne mettant aucune restriction\";'),('fr','messages:apihelp-purge-description','s:106:\"Vider le cache des titres fournis.\n\nNécessite une requête POST si l’utilisateur n’est pas connecté.\";'),('fr','messages:apihelp-purge-param-forcelinkupdate','s:35:\"Mettre à jour les tables de liens.\";'),('fr','messages:apihelp-purge-param-forcerecursivelinkupdate','s:125:\"Mettre à jour la table des liens, et mettre à jour les tables de liens pour toute page qui utilise cette page comme modèle\";'),('fr','messages:apihelp-purge-example-simple','s:62:\"Purger les pages <kbd>Page principale</kbd> et <kbd>API</kbd>.\";'),('fr','messages:apihelp-purge-example-generator','s:62:\"Purger les 10 premières pages de l’espace de noms principal\";'),('fr','messages:apihelp-query-description','s:204:\"Extraire des données de et sur MédiaWiki.\n\nTout