y+allcategories-param-dir','s:30:\"Direction dans laquelle trier.\";'),('fr','messages:apihelp-query+allcategories-param-min','s:71:\"Renvoyer uniquement les catégories avec au moins ce nombre de membres.\";'),('fr','messages:apihelp-query+allcategories-param-max','s:70:\"Renvoyer uniquement les catégories avec au plus ce nombre de membres.\";'),('fr','messages:apihelp-query+allcategories-param-limit','s:32:\"Combien de catégories renvoyer.\";'),('fr','messages:apihelp-query+allcategories-param-prop','s:34:\"Quelles propriétés récupérer :\";'),('fr','messages:apihelp-query+allcategories-paramvalue-prop-size','s:45:\"Ajoute le nombre de pages dans la catégorie.\";'),('fr','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:82:\"Marque les catégories qui sont masquées avec <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('fr','messages:apihelp-query+allcategories-example-size','s:79:\"Lister les catégories avec l’information sur le nombre de pages dans chacune\";'),('fr','messages:apihelp-query+allcategories-example-generator','s:118:\"Récupérer l’information sur la page de catégorie elle-même pour les catégories commençant par <kbd>List</kbd>.\";'),('fr','messages:apihelp-query+alldeletedrevisions-description','s:86:\"Lister toutes les révisions supprimées par un utilisateur ou dans un espace de noms.\";'),('fr','messages:apihelp-query+alldeletedrevisions-paraminfo-useronly','s:45:\"Utilisable uniquement avec <var>$3user</var>.\";'),('fr','messages:apihelp-query+alldeletedrevisions-paraminfo-nonuseronly','s:46:\"Impossible à utiliser avec <var>$3user</var>.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-start','s:50:\"L’horodatage auquel démarrer l’énumération.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-end','s:49:\"L’horodatage auquel arrêter l’énumération.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-from','s:31:\"Démarrer la liste à ce titre.\";'),('fr','messages:apihelp-query+alldeletedrevisions-param-to','s:3