lp-query+blocks-param-start','s:50:\"L’horodatage auquel démarrer l’énumération.\";'),('fr','messages:apihelp-query+blocks-param-end','s:49:\"L’horodatage auquel arrêter l’énumération.\";'),('fr','messages:apihelp-query+blocks-param-ids','s:45:\"Liste des IDs de bloc à lister (facultatif).\";'),('fr','messages:apihelp-query+blocks-param-users','s:50:\"Liste des utilisateurs à rechercher (facultatif).\";'),('fr','messages:apihelp-query+blocks-param-ip','s:234:\"Obtenir tous les blocs s’appliquant à cette adresse IP ou à cette plage CIDR, y compris les blocs de plage.\nImpossible à utiliser avec <var>$3users</var>. Les plages CIDR plus larges que IPv4/$1 ou IPv6/$2 ne sont pas acceptées.\";'),('fr','messages:apihelp-query+blocks-param-limit','s:37:\"Le nombre maximal de blocs à lister.\";'),('fr','messages:apihelp-query+blocks-param-prop','s:30:\"Quelles propriétés obtenir :\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-id','s:25:\"Ajoute l’ID du blocage.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-user','s:41:\"Ajoute le nom de l’utilisateur bloqué.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-userid','s:41:\"Ajoute l’ID de l’utilisateur bloqué.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-by','s:47:\"Ajoute le nom de l’utilisateur ayant bloqué.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-byid','s:47:\"Ajoute l’ID de l’utilisateur ayant bloqué.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:33:\"Ajoute l’horodatage du blocage.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:48:\"Ajoute l’horodatage d’expiration du blocage.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-reason','s:27:\"Ajoute le motif du blocage.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-range','s:57:\"Ajoute la plage d’adresses IP affectée par le blocage.\";'),('fr','messages:apihelp-query+blocks-paramvalue-prop-flags','s:56:\"Marque le bannissement avec (autobloc