plutôt $1starthexsortkey.\";'),('fr','messages:apihelp-query+categorymembers-param-endsortkey','s:33:\"Utiliser plutôt $1endhexsortkey.\";'),('fr','messages:apihelp-query+categorymembers-example-simple','s:63:\"Obtenir les 10 premières pages de <kbd>Category:Physics</kbd>.\";'),('fr','messages:apihelp-query+categorymembers-example-generator','s:83:\"Obtenir l’information sur les 10 premières pages de <kbd>Category:Physics</kbd>.\";'),('fr','messages:apihelp-query+contributors-description','s:98:\"Obtenir la liste des contributeurs connectés et le nombre de contributeurs anonymes d’une page.\";'),('fr','messages:apihelp-query+contributors-param-group','s:146:\"Inclure uniquement les utilisateurs dans les groupes donnés. Ne pas inclure les groupes implicites ou auto-promus comme *, user ou autoconfirmed.\";'),('fr','messages:apihelp-query+contributors-param-excludegroup','s:130:\"Exclure les utilisateurs des groupes donnés. Ne pas inclure les groupes implicites ou auto-promus comme *, user ou autoconfirmed.\";'),('fr','messages:apihelp-query+contributors-param-rights','s:171:\"Inclure uniquement les utilisateurs ayant les droits donnés. Ne pas inclure les droits accordés par les groupes implicites ou auto-promus comme *, user ou autoconfirmed.\";'),('fr','messages:apihelp-query+contributors-param-excluderights','s:160:\"Exclure les utilisateurs ayant les droits donnés. Ne pas inclure les droits accordés par les groupes implicites ou auto-promus comme *, user ou autoconfirmed.\";'),('fr','messages:apihelp-query+contributors-param-limit','s:34:\"Combien de contributeurs renvoyer.\";'),('fr','messages:apihelp-query+contributors-example-simple','s:56:\"Afficher les contributeurs dans la <kbd>Main Page</kbd>.\";'),('fr','messages:apihelp-query+deletedrevisions-description','s:386:\"Obtenir des informations sur la révision supprimée.\n\nPeut être utilisé de différentes manières :\n# Obtenir les révisions supprimées pour un ensemble de pages, en donnant les titres ou les ids de page. Ordonné par titre  et horodatage.\n# Obtenir des données sur un ensemble de révisions supprimées en donnant leurs IDs et leurs ids de révision. Ordonné par ID de révision.\";'),('fr','messages:apihelp-query+deletedrevisions-param-start','s:114:\"L’horodatage auquel démarrer l’énumération. Ignoré lors du traitement d’une liste d’IDs de révisions.\";'),('fr','messages:apihelp-query+deletedrevisions-param-end','s:113:\"L’horodatage auquel arrêter l’énumération. Ignoré lors du traitement d’une liste d’IDs de révisions.\";'),('fr','messages:apihelp-query+deletedrevisions-param-tag','s:60:\"Lister uniquement les révisions marquées par cette balise.\";'),('fr','messages:apihelp-query+deletedrevisions-param-user','s:60:\"Lister uniquement les révisions faites par cet utilisateur.\";'),('fr','messages:apihelp-query+deletedrevisions-param-excludeuser','s:56:\"Ne pas lister les révisions faites par cet utilisateur.\";'),('fr','messages:apihelp-query+deletedrevisions-example-titles','s:113:\"Lister les révisions supprimées des pages <kbd>Main Page</kbd> et <kbd>Talk:Main Page</kbd>, avec leur contenu.\";'),('fr','messages:apihelp-query+deletedrevisions-example-revids','s:71:\"Lister les informations pour la révision supprimée <kbd>123456</kbd>.\";'),('fr','messages:apihelp-query+deletedrevs-description','s:521:\"Lister les révisions supprimées.\n\nOpère selon trois modes :\n# Lister les révisions supprimées pour les titres donnés, triées par horodatage.\n# Lister les contributions supprimées pour l’utilisateur donné, triées par horodatage (pas de titres spécifiés).\n# Lister toutes les révisions supprimées dans l’espace de noms donné, triées par titre et horodatage (aucun titre spécifié, $1user non positionné).\n\nCertains paramètres ne s’appliquent qu’à certains modes et sont ignorés dans les autres.\";'),('fr','messages:apihelp-query+deletedrevs-paraminfo-modes','s:29:\"{{PLURAL:$1|Mode|Modes}} : $2\";'),('fr','messages:apihelp-query+deletedrevs-param-start','s:50:\