e1','s:134:\"Lister les dernières révisions supprimées de des pages <kbd>Main Page</kbd> et <kbd>Talk:Main Page</kbd>, avec le contenu (mode 1).\";'),('fr','messages:apihelp-query+deletedrevs-example-mode2','s:78:\"Lister les 50 dernières contributions de <kbd>Bob</kbd> supprimées (mode 2).\";'),('fr','messages:apihelp-query+deletedrevs-example-mode3-main','s:90:\"Lister les 50 premières révisions supprimées dans l’espace de noms principal (mode 3)\";'),('fr','messages:apihelp-query+deletedrevs-example-mode3-talk','s:88:\"Lister les 50 premières pages supprimées dans l’espace de noms {{ns:talk}} (mode 3).\";'),('fr','messages:apihelp-query+disabled-description','s:42:\"Ce module de requête a été désactivé.\";'),('fr','messages:apihelp-query+duplicatefiles-description','s:104:\"Lister tous les fichiers qui sont des doublons des fichiers donnés d’après leurs valeurs de hachage.\";'),('fr','messages:apihelp-query+duplicatefiles-param-limit','s:43:\"Combien de fichiers dupliqués à renvoyer.\";'),('fr','messages:apihelp-query+duplicatefiles-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+duplicatefiles-param-localonly','s:63:\"Rechercher les fichiers uniquement dans le référentiel local.\";'),('fr','messages:apihelp-query+duplicatefiles-example-simple','s:61:\"Rechercher les doublons de [[:File:Albert Einstein Head.jpg]]\";'),('fr','messages:apihelp-query+duplicatefiles-example-generated','s:44:\"Rechercher les doublons de tous les fichiers\";'),('fr','messages:apihelp-query+embeddedin-description','s:73:\"Trouver toutes les pages qui incluent (par transclusion) le titre donné.\";'),('fr','messages:apihelp-query+embeddedin-param-title','s:58:\"Titre à rechercher. Impossible à utiliser avec $1pageid.\";'),('fr','messages:apihelp-query+embeddedin-param-pageid','s:65:\"ID de la page à rechercher. Impossible à utiliser avec $1title.\";'),('fr','messages:apihelp-query+embeddedin-param-namespace','s:33:\"L’espace de noms à énumérer.\";'),('fr','messages:apihelp-query+embeddedin-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+embeddedin-param-filterredir','s:33:\"Comment filtrer les redirections.\";'),('fr','messages:apihelp-query+embeddedin-param-limit','s:35:\"Combien de pages renvoyer au total.\";'),('fr','messages:apihelp-query+embeddedin-example-simple','s:53:\"Afficher les pages incluant <kbd>Template:Stub</kbd>.\";'),('fr','messages:apihelp-query+embeddedin-example-generator','s:72:\"Obteir des informations sur les pages incluant <kbd>Template:Stub</kbd>.\";'),('fr','messages:apihelp-query+extlinks-description','s:70:\"Renvoyer toutes les URLs externes (non interwikis) des pages données.\";'),('fr','messages:apihelp-query+extlinks-param-limit','s:26:\"Combien de liens renvoyer.\";'),('fr','messages:apihelp-query+extlinks-param-protocol','s:190:\"Protocole de l’URL. Si vide et <var>$1query</var> est positionné, le protocole est <kbd>http</kbd>. Laisser à la fois ceci et <var>$1query</var> vide pour lister tous les liens externes.\";'),('fr','messages:apihelp-query+extlinks-param-query','s:115:\"Rechercher une chaîne sans protocole. Utile pour vérifier si une certaine page contient une certaine URL externe.\";'),('fr','messages:apihelp-query+extlinks-param-expandurl','s:69:\"Étendre les URLs relatives au protocole avec le protocole canonique.\";'),('fr','messages:apihelp-query+extlinks-example-simple','s:60:\"Obtenir une liste des liens externes de <kbd>Main Page<kbd>.\";'),('fr','messages:apihelp-query+exturlusage-description','s:47:\"Énumérer les pages contenant une URL donnée.\";'),('fr','messages:apihelp-query+exturlusage-param-prop','s:30:\"Quelles informations inclure :\";'),('fr','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:25:\"Ajoute l’ID de la page.\";'),('fr','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:59:\"Ajoute le titre et l’ID de l’espace de noms de la page.\";'),('fr','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:38:\"Ajoute l’URL utilisée dans la page.\";'),('fr','messages:apihelp-query+exturlusage-param-protocol','s:180:\"Protocole de l’URL. Si vide et que <var>$1query</var>  est rempli, le protocole est <kbd>http</kbd>. Le laisser avec <var>$1query</var>  vide pour lister tous les liens externes.\";'),('fr','messages:apihelp-query+exturlusage-param-query','s:115:\"Rechercher une chaîne sans protocole. Voyez [[Special:LinkSearch]]. Le laisser vide liste tous les liens externes.\";'),('fr','messages:apihelp-query+exturlusage-param-namespace','s:33:\"Les espaces de nom à énumérer.\";'),('fr','messages:apihelp-query+exturlusage-param-limit','s:26:\"Combien de pages renvoyer.\";'),('fr','messages:apihelp-query+exturlusage-param-expandurl','s:69:\"Étendre les URLs relatives au protocole avec le protocole canonique.\";'),('fr','messages:apihelp-query+exturlusage-example-simple','s:73:\"Afficher les pages avec un lien vers <kbd>http://www.mediawiki.org</kbd>.\";'),('fr','messages:apihelp-query+filearchive-description','s:58:\"Énumérer séquentiellement tous les fichiers supprimés.\";'),('fr','messages:apihelp-query+filearchive-param-from','s:57:\"Le titre de l’image auquel démarrer l’énumération.\";'),('fr','messages:apihelp-query+filearchive-param-to','s:56:\"Le titre de l’image auquel arrêter l’énumération.\";'),('fr','messages:apihelp-query+filearchive-param-prefix','s:69:\"Rechercher tous les titres d’image qui commencent par cette valeur.\";'),('fr','messages:apihelp-query+filearchive-param-limit','s:37:\"Combien d’images renvoyer au total.\";'),('fr','messages:apihelp-query+filearchive-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+filearchive-param-sha1','s:48:\"Hachage SHA1 de l’image. Écrase $1sha1base36.\";'),('fr','messages:apihelp-query+filearchive-param-sha1base36','s:64:\"Hachage SHA1 de l’image en base 36 (utilisé dans MédiaWiki).\";'),('fr','messages:apihelp-query+filearchive-param-prop','s:42:\"Quelle information obtenir sur l’image :\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:39:\"Ajoute le hachage SHA-1 pour l’image.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:55:\"Ajoute l÷’horodatage pour la version téléchargée.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-user','s:67:\"Ajoute l’utilisateur qui a téléchargé la version de l’image.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-size','s:111:\"Ajoute la taille de l’image en octets et la hauteur, la largeur et le nombre de page (si c’est applicable).\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-dimensions','s:21:\"Alias pour la taille.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-description','s:49:\"Ajoute la description de la version de l’image.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-parseddescription','s:38:\"Analyser la description de la version.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-mime','s:28:\"Ajoute le MIME de l’image.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-mediatype','s:38:\"Ajoute le type de média de l’image.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-metadata','s:58:\"Liste les métadonnées Exif pour la version de l’image.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:42:\"Ajoute la profondeur de bit de la version.\";'),('fr','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:93:\"Ajoute le nom de fichier de la version d’archive pour les versions autres que la dernière.\";'),('fr','messages:apihelp-query+filearchive-example-simple','s:50:\"Afficher une liste de tous les fichiers supprimés\";'),('fr','messages:apihelp-query+filerepoinfo-description','s:90:\"Renvoyer les méta-informations sur les référentiels d’image configurés dans le wiki.\";'),('fr','messages:apihelp-query+filerepoinfo-param-prop','s:564:\"Quelles propriétés du référentiel récupérer (il peut y en avoir plus de disponibles sur certains wikis) :\n;apiurl:URL de l’API du référentiel - utile pour obtenir les infos de l’image depuis l’hôte.\n;name:La clé du référentiel - utilisé par ex. dans les valeurs de retour de <var>[[mw:Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> et [[Special:ApiHelp/query+imageinfo|imageinfo]].\n;displayname:Le nom lisible du wiki référentiel.\n;rooturl:URL racine des chemins d’image.\n;local:Si ce référentiel est le référentiel local ou non.\";'),('fr','messages:apihelp-query+filerepoinfo-example-simple','s:57:\"Obtenir l’information sur les référentiels de fichier\";'),('fr','messages:apihelp-query+fileusage-description','s:60:\"Trouver toutes les pages qui utilisent les fichiers donnés.\";'),('fr','messages:apihelp-query+fileusage-param-prop','s:30:\"Quelles propriétés obtenir :\";'),('fr','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:18:\"ID de chaque page.\";'),('fr','messages:apihelp-query+fileusage-paramvalue-prop-title','s:21:\"Titre de chaque page.\";'),('fr','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:38:\"Marque si la page est une redirection.\";'),('fr','messages:apihelp-query+fileusage-param-namespace','s:53:\"Inclure uniquement les pages dans ces espaces de nom.\";'),('fr','messages:apihelp-query+fileusage-param-limit','s:17:\"Combien renvoyer.\";'),('fr','messages:apihelp-query+fileusage-param-show','s:172:\"Afficher uniquement les éléments qui correspondent à ces critères :\n;redirect:Afficher uniquement les redirections.\n;!redirect:Afficher uniquement les non-redirections.\";'),('fr','messages:apihelp-query+fileusage-example-simple','s:59:\"Obtenir une liste des pages utilisant [[:File:Example.jpg]]\";'),('fr','messages:apihelp-query+fileusage-example-generator','s:69:\"Obtenir l’information sur les pages utilisant [[:File:Example.jpg]]\";'),('fr','messages:apihelp-query+imageinfo-description','s:74:\"Renvoyer l’information de fichier et l’historique de téléchargement.\";'),('fr','messages:apihelp-query+imageinfo-param-prop','s:1489:\"Quelles informations obtenir du fichier :\n;timestamp:Ajoute l’horodatage de la version téléchargée.\n;user:Ajoute l’utilisateur qui a téléchargé chaque version du fichier.\n;userid:Ajoute l’ID de l’utilisateur qui a téléchargé chaque version du fichier.\n;comment:Commentaire sur la version.\n;parsedcomment:Analyser le commentaire sur cette version.\n;canonicaltitle:Ajoute le titre canonique du fichier.\n;url:Fournit l’URL du fichier et la page de description.\n;size:Ajoute la taille du fichier en octets et la hauteur, la largeur et le nombre de pages (si applicable).\n;dimensions:Alias pour la taille.\n;sha1:Ajoute le hachage SHA-1 pour le fichier.\n;mime:Ajoute le type MIME du fichier.\n;thumbmime:Ajoute le type MIME de la vignette de l’image (nécessite l’URL et le paramètre $1urlwidth).\n;mediatype:Ajoute le type de média du fichier.\n;metadata:Liste les métadonnées Exif de la version du fichier.\n;commonmetadata:Liste les métadonnées génériques du format du fichier pour la version du fichier.\n;extmetadata:Liste les métadonnées mises en forme combinées depuis différentes sources. Les résultats sont au format HTML.\n;archivename:Ajoute le nom de fichier de la version d’archive pour les versions autres que la dernière.\n;bitdepth:Ajoute la profondeur de bit de la version.\n;uploadwarning:Utilisé par la page Special:Upload pour obtenir de l’information sur un fichier existant. Non prévu pour être utilisé en dehors du cœur de MédiaWiki.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:51:\"Ajoute l’horodatage à la version téléchargée.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:69:\"Ajoute l’utilisateur qui a téléchargé chaque version du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:80:\"Ajouter l’ID de l’utilisateur qui a téléchargé chaque version du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:27:\"Commentaire sur la version.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:38:\"Analyser le commentaire de la version.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:37:\"Ajoute le titre canonique du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:56:\"Fournit l’URL du fichier et de la page de description.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:100:\"Ajoute la taille du fichier en octets et sa hauteur, largeur et compteur de page (le cas échéant).\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:21:\"Alias pour la taille.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:35:\"Ajoute le hachage SH1-1 du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:31:\"Ajoute le type MIME du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:97:\"Ajoute le type MIME de la vignette de l’image (nécessite l’URL et le paramètre $1urlwidth).\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:36:\"Ajoute le type de média du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:54:\"Liste les métadonnées Exif de la version du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:85:\"Liste les métadonnées génériques du format du fichier pour la version du fichier.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:110:\"Liste les métadonnées mises en forme combinées depuis diverses sources. Les résultats sont au format HTML.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:93:\"Ajoute le nom de fichier de la version d’archive pour les versions autres que la dernière.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:43:\"Ajoute la profondeur de bits de la version.\";'),('fr','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:157:\"Utilisé par la page Special:Upload pour obtenir de l’information sur un fichier existant. Non prévu pour être utilisé en dehors du cœur de MédiaWiki.\";'),('fr','messages:apihelp-query+imageinfo-param-limit','s:53:\"Combien de révision de fichier renvoyer par fichier.\";'),('fr','messages:apihelp-query+imageinfo-param-start','s:37:\"Horodatage auquel démarrer la liste.\";'),('fr','messages:apihelp-query+imageinfo-param-end','s:36:\"Horodatage auquel arrêter la liste.\";'),('fr','messages:apihelp-query+imageinfo-param-urlwidth','s:224:\"Si $2prop=url est défini, une URL vers une image à l’échelle de cette largeur sera renvoyée.\nPour des raisons de performance si cette option est utilisée, pas plus de $1 images mises à l’échelle seront renvoyées.\";'),('fr','messages:apihelp-query+imageinfo-param-urlheight','s:24:\"Similaire à $1urlwidth.\";'),('fr','messages:apihelp-query+imageinfo-param-metadataversion','s:168:\"Version de métadonnées à utiliser. Si <kbd>latest</kbd> est spécifié, utiliser la dernière version. Par défaut à <kbd>1</kbd> pour la compatibilité ascendante.\";'),('fr','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:200:\"Quelle langue pour analyser extmetadata. Cela affecte à la fois quelle traduction analyser, s’il y en a plusieurs, et comment les choses comme les nombres et d’autres valeurs sont mises en forme.\";'),('fr','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:89:\"Si des traductions pour la propriété extmetadata sont disponibles, les analyser toutes.\";'),('fr','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:86:\"Si spécifié et non vide, seules ces clés seront renvoyées pour $1prop=extmetadata.\";'),('fr','messages:apihelp-query+imageinfo-param-urlparam','s:208:\"Une chaîne de paramètre spécifique à l’analyseur. Par exemple, les PDFs peuvent utiliser <kbd>page15-100px</kbd>. <var>$1urlwidth</var> doit être utilisé et être cohérent avec <var>$1urlparam</var>.\";'),('fr','messages:apihelp-query+imageinfo-param-localonly','s:63:\"Rechercher les fichiers uniquement dans le référentiel local.\";'),('fr','messages:apihelp-query+imageinfo-example-simple','s:87:\"Analyser les informations sur la version actuelle de [[:File:Albert Einstein Head.jpg]]\";'),('fr','messages:apihelp-query+imageinfo-example-dated','s:76:\"Analyser les informations sur les versions de [[:File:Test.jpg]] depuis 2008\";'),('fr','messages:apihelp-query+images-description','s:59:\"Renvoie tous les fichiers contenus dans les pages fournies.\";'),('fr','messages:apihelp-query+images-param-limit','s:29:\"Combien de fichiers renvoyer.\";'),('fr','messages:apihelp-query+images-param-images','s:100:\"Lister uniquement ces fichiers. Utile pour vérifier si une page donnée contient un fichier donné.\";'),('fr','messages:apihelp-query+images-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+images-example-simple','s:59:\"Obtenir une liste des fichiers utilisés dans [[Main Page]]\";'),('fr','messages:apihelp-query+images-example-generator','s:75:\"Obtenir des informations sur tous les fichiers utilisés dans [[Main Page]]\";'),('fr','messages:apihelp-query+imageusage-description','s:68:\"Trouver toutes les pages qui utilisent le titre de l’image donné.\";'),('fr','messages:apihelp-query+imageusage-param-title','s:58:\"Titre à rechercher. Impossible à utiliser avec $1pageid.\";'),('fr','messages:apihelp-query+imageusage-param-pageid','s:65:\"ID de la page à rechercher. Impossible à utiliser avec $1title.\";'),('fr','messages:apihelp-query+imageusage-param-namespace','s:33:\"L’espace de noms à énumérer.\";'),('fr','messages:apihelp-query+imageusage-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+imageusage-param-filterredir','s:132:\"Comment filtrer les redirections. Si mis à nonredirects quand $1redirect est activé, cela ne s’appliquera qu’au second niveau.\";'),('fr','messages:apihelp-query+imageusage-param-limit','s:219:\"Combien de pages renvoyer au total. Si <var>$1redirect</var> est activé, la limite s’applique à chaque niveau séparément (ce qui veut dire que jusqu’à 2 * <var>$1limit</var> résultats peuvent être renvoyés).\";'),('fr','messages:apihelp-query+imageusage-param-redirect','s:158:\"Si le lien vers une page est une redirection, trouver toutes les pages qui ont aussi un lien vers cette redirection. La limite maximale est divisée par deux.\";'),('fr','messages:apihelp-query+imageusage-example-simple','s:63:\"Afficher les pages utilisant [[:File:Albert Einstein Head.jpg]]\";'),('fr','messages:apihelp-query+imageusage-example-generator','s:83:\"Obtenir des informations sur les pages utilisant [[:File:Albert Einstein Head.jpg]]\";'),('fr','messages:apihelp-query+info-description','s:45:\"Obtenir les informations de base sur la page.\";'),('fr','messages:apihelp-query+info-param-prop','s:764:\"Quelles propriétés supplémentaires récupérer :\n;protection:Liste de niveau de protection de chaque page.\n;talkid:L’ID de la page de discussion pour chaque page qui n’est pas une page de discussion.\n;watched:Liste de l’état de suivi de chaque page.\n;watchers:Le nombre d’observateurs, si c&est autorisé.\n;notificationtimestamp:L’horodatage de notification de la liste de suivi de chaque page.\n;subjectid:L’ID de la page parente de chaque page de discussion.\n;url:Fournit une URL complète, une URL de modification, et l’URL canonique pour chaque page.\n;readable:Si l’utilisateur peut lire cette page.\n;preload:Fournit le texte renvoyé par EditFormPreloadText.\n;displaytitle:Fournit la manière dont le titre de la page est vraiment affiché.\";'),('fr','messages:apihelp-query+info-paramvalue-prop-protection','s:46:\"Lister le niveau de protection de chaque page.\";'),('fr','messages:apihelp-query+info-paramvalue-prop-talkid','s:77:\"L’ID de la page de discussion de chaque page qui n’est pas