p-query+iwbacklinks-param-prefix','s:28:\"Préfixe pour l’interwiki.\";'),('fr','messages:apihelp-query+iwbacklinks-param-title','s:77:\"Lien interwiki à rechercher. Doit être utilisé avec <var>$1blprefix</var>.\";'),('fr','messages:apihelp-query+iwbacklinks-param-limit','s:26:\"Combien de pages renvoyer.\";'),('fr','messages:apihelp-query+iwbacklinks-param-prop','s:30:\"Quelles propriétés obtenir :\";'),('fr','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:36:\"Ajoute le préfixe de l’interwiki.\";'),('fr','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:33:\"Ajoute le titre de l’interwiki.\";'),('fr','messages:apihelp-query+iwbacklinks-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+iwbacklinks-example-simple','s:55:\"Obtenir les pages ayant un lien vers [[wikibooks:Test]]\";'),('fr','messages:apihelp-query+iwbacklinks-example-generator','s:76:\"Obtenir des informations sur les pages ayant un lien vers [[wikibooks:Test]]\";'),('fr','messages:apihelp-query+iwlinks-description','s:54:\"Renvoie tous les liens interwiki des pages indiquées.\";'),('fr','messages:apihelp-query+iwlinks-param-url','s:73:\"S&il faut obtenir l’URL complète (impossible à utiliser avec $1prop).\";'),('fr','messages:apihelp-query+iwlinks-param-prop','s:76:\"Quelles propriétés supplémentaires obtenir pour chaque lien interlangue :\";'),('fr','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:25:\"Ajoute l’URL complète.\";'),('fr','messages:apihelp-query+iwlinks-param-limit','s:36:\"Combien de liens interwiki renvoyer.\";'),('fr','messages:apihelp-query+iwlinks-param-prefix','s:57:\"Renvoyer uniquement les liens interwiki avec ce préfixe.\";'),('fr','messages:apihelp-query+iwlinks-param-title','s:75:\"Lien interwiki à rechercher. Doit être utilisé avec <var>$1prefix</var>.\";'),('fr','messages:apihelp-query+iwlinks-param-dir','s:34:\"La direction dans laquelle lister.\";'),('fr','messages:apihelp-query+iwlinks-example-si