;'),('fr','messages:apihelp-rsd-description','s:51:\"Exporter un schéma RSD (Découverte Très Simple).\";'),('fr','messages:apihelp-rsd-example-simple','s:23:\"Exporter le schéma RSD\";'),('fr','messages:apihelp-setnotificationtimestamp-description','s:271:\"Mettre à jour l’horodatage de notification pour les pages suivies.\n\nCela affecte la mise en évidence des pages modifiées dans la liste de suivi et l’historique, et l’envoi de courriel quand la préférence « {{int:tog-enotifwatchlistpages}} » est activée.\";'),('fr','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:40:\"Travailler sur toutes les pages suivies.\";'),('fr','messages:apihelp-setnotificationtimestamp-param-timestamp','s:40:\"Horodatage auquel dater la notification.\";'),('fr','messages:apihelp-setnotificationtimestamp-param-torevid','s:83:\"Révision pour laquelle fixer l’horodatage de notification (une page uniquement).\";'),('fr','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:87:\"Révision pour fixer l’horodatage de notification plus récent (une page uniquement).\";'),('fr','messages:apihelp-setnotificationtimestamp-example-all','s:69:\"Réinitialiser l’état de notification pour toute la liste de suivi\";'),('fr','messages:apihelp-setnotificationtimestamp-example-page','s:75:\"Réinitialiser l’état de notification pour la <kbd>Page principale<kbd>.\";'),('fr','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:143:\"Fixer l’horodatage de notification pour <kbd>Page principale</kbd> afin que toutes les modifications depuis le 1 janvier 2012 soient non vues\";'),('fr','messages:apihelp-setnotificationtimestamp-example-allpages','s:102:\"Réinitialiser l’état de notification sur les pages dans l’espace de noms <kbd>{{ns:user}}</kbd>.\";'),('fr','messages:apihelp-tag-description','s:106:\"Ajouter ou enlever des balises de modification aux révisions ou ou aux entrées de journal individuelles.\";'),('fr','messages:apihelp-tag-param-rcid','s:90:\"Un ou plus IDs de modification récente à partir desquels ajouter ou supprimer la balise.\";'),('fr','messages:apihelp-tag-param-revid','s:78:\"Un ou plus IDs de révision à partir desquels ajouter ou supprimer la balise.\";'),('fr','messages:apihelp-tag-param-logid','s:88:\"Un ou plus IDs d’entrée de journal à partir desquels ajouter ou supprimer la balise.\";'),('fr','messages:apihelp-tag-param-add','s:86:\"Balises à ajouter. Seules les balises définies manuellement peuvent être ajoutées.\";'),('fr','messages:apihelp-tag-param-remove','s:131:\"Balises à supprimer. Seules les balises qui sont soit définies manuellement soit pas du tout définies peuvent être supprimées.\";'),('fr','messages:apihelp-tag-param-reason','s:25:\"Motif de la modification.\";'),('fr','messages:apihelp-tag-example-rev','s:97:\"Ajoute la balise <kbd>vandalism</kbd> à partir de l’ID de révision 123 sans indiquer de motif\";'),('fr','messages:apihelp-tag-example-log','s:123:\"Supprimer la balise <kbd>spam</kbd> à partir de l’ID d’entrée de journal 123 avec le motif <kbd>Wrongly applied</kbd>\";'),('fr','messages:apihelp-tokens-description','s:158:\"Obtenir les jetons pour les actions modifiant les données.\n\nCe module est obsolète, remplacé par [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('fr','messages:apihelp-tokens-param-type','s:27:\"Types de jeton à demander.\";'),('fr','messages:apihelp-tokens-example-edit','s:51:\"Récupérer un jeton de modification (par défaut).\";'),('fr','messages:apihelp-tokens-example-emailmove','s:61:\"Récupérer un jeton de courriel et un jeton de déplacement.\";'),('fr','messages:apihelp-unblock-description','s:26:\"Débloquer un utilisateur.\";'),('fr','messages:apihelp-unblock-param-id','s:106:\"ID du blocage à lever (obtenu via <kbd>list=blocks</kbd>). Impossible à utiliser avec <var>$1user</var>.\";'),('fr','messages:apihelp-unblock-param-user','s:115:\"Nom d’utilisateur, adresse IP ou plage d’adresse IP à débloquer. Impossible à utiliser avec <var>$1id</var>.\";'),('fr','messages:apihelp-unblock-param-reason','s:20:\"Motif de déblocage.\";'),('fr','messages:apihelp-unblock-example-id','s:40:\"Lever le blocage d’ID #<kbd>105</kbd>.\";'),('fr','messages:apihelp-unblock-example-user','s:80:\"Débloquer l’utilisateur <kbd>Bob</kbd> avec le motif <kbd>Désolé Bob</kbd>.\";'),('fr','messages:apihelp-undelete-description','s:320:\"Restaurer les révisions d’une page supprimée.\n\nUne liste des révisions supprimées (avec les horodatages) peut être récupérée via [[Special:ApiHelp/query+deletedrevs|list=deletedrevs]], et une liste d’IDs de fichier supprimé peut être récupérée via [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('fr','messages:apihelp-undelete-param-title','s:30:\"Titre de la page à restaurer.\";'),('fr','messages:apihelp-undelete-param-reason','s:22:\"Motif de restauration.\";'),('fr','messages:apihelp-undelete-param-timestamps','s:130:\"Horodatages des révisions à restaurer. Si <var>$1timestamps</var> et <var>$1fileids</var> sont vides, toutes seront restaurées.\";'),('fr','messages:apihelp-undelete-param-fileids','s:133:\"IDs des révisions de fichier à restaurer. Si <var>$1timestamps</var> et <var>$1fileids</var> sont vides, toutes seront restaurées.\";'),('fr','messages:apihelp-undelete-param-watchlist','s:147:\"Ajouter ou supprimer la page de la liste de suivi de l’utilisateur actuel sans condition, utiliser les préférences ou ne pas modifier le suivi.\";'),('fr','messages:apihelp-undelete-example-page','s:55:\"Annuler la suppression de la page <kbd>Main Page</kbd>.\";'),('fr','messages:apihelp-undelete-example-revisions','s:74:\"Annuler la suppression de deux révisions de la page <kbd>Main Page</kbd>.\";'),('fr','messages:apihelp-upload-description','s:773:\"Téléverser un fichier, ou obtenir l’état des téléversements en cours.\n\nPlusieurs méthodes sont disponibles :\n* Téléverser directement le contenu du fichier, en utilisant le paramètre <var>$1file</var>.\n* Téléverser le fichier par morceaux, en utilisant les paramètres <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var>.\n* Pour que le serveur MédiaWiki cherche un fichier depuis une URL, utilisez le paramètre <var>$1url</var>.\n* Terminer un téléversement précédent qui a échoué à cause d’avertissements, en utilisant le paramètre <var>$1filekey</var>.\nNoter que le POST HTTP doit être fait comme un téléversement de fichier (par ex. en utilisant <code>multipart/form-data</code>) en envoyant le <code>multipart/form-data</code>.\";'),('fr','messages:apihelp-upload-param-filename','s:21:\"Nom de fichier cible.\";'),('fr','messages:apihelp-upload-param-comment','s:148:\"Télécharger le commentaire. Utilisé aussi comme texte de la page initiale pour les nouveaux fichiers si <var>$1text</var> n’est pas spécifié.\";'),('fr','messages:apihelp-upload-param-text','s:50:\"Texte de page initiale pour les nouveaux fichiers.\";'),('fr','messages:apihelp-upload-param-watch','s:15:\"Suivre la page.\";'),('fr','messages:apihelp-upload-param-watchlist','s:146:\"Ajouter ou supprimer sans condition la page de la liste de suivi de l’utilisateur actuel, utiliser les préférences ou ne pas changer le suivi.\";'),('fr','messages:apihelp-upload-param-ignorewarnings','s:32:\"Ignorer tous les avertissements.\";'),('fr','messages:apihelp-upload-param-file','s:19:\"Contenu du fichier.\";'),('fr','messages:apihelp-upload-param-url','s:28:\"URL où chercher le fichier.\";'),('fr','messages:apihelp-upload-param-filekey','s:79:\"Clé identifiant un téléchargement précédent temporairement mis en attente.\";'),('fr','messages:apihelp-upload-param-sessionkey','s:74:\"Comme $1filekey, conservé pour des raisons de compatibilité descendante.\";'),('fr','messages:apihelp-upload-param-stash','s:98:\"Si positionné, le serveur conservera temporairement le fichier au lieu de l’ajouter au dépôt.\";'),('fr','messages:apihelp-upload-param-filesize','s:46:\"Taille du fichier de tout le téléchargement.\";'),('fr','messages:apihelp-upload-param-offset','s:28:\"Décalage du bloc en octets.\";'),('fr','messages:apihelp-upload-param-chunk','s:18:\"Partie du contenu.\";'),('fr','messages:apihelp-upload-param-async','s:91:\"Faire de façon asynchrone les grosses opérations sur les fichiers quand c’est possible.\";'),('fr','messages:apihelp-upload-param-asyncdownload','s:52:\"Faire de façon asynchrone la recherche d’une URL.\";'),('fr','messages:apihelp-upload-param-leavemessage','s:118:\"Si asyncdownload est utilisé, laisser un message sur la page de discussion de l’utilisateur quand c’est terminé.\";'),('fr','messages:apihelp-upload-param-statuskey','s:93:\"Récupérer l’état de téléchargement pour cette clé de fichier (téléchargé par URL).\";'),('fr','messages:apihelp-upload-param-checkstatus','s:85:\"Récupérer uniquement l’état de téléchargement pour la clé de fichier donnée.\";'),('fr','messages:apihelp-upload-example-url','s:28:\"Télécharger depuis une URL\";'),('fr','messages:apihelp-upload-example-filekey','s:71:\"Terminer un téléchargement qui a échoué à cause d’avertissements\";'),('fr','messages:apihelp-userrights-description','s:58:\"Modifier l’appartenance d’un utilisateur à un groupe.\";'),('fr','messages:apihelp-userrights-param-user','s:20:\"Nom d’utilisateur.\";'),('fr','messages:apihelp-userrights-param-userid','s:22:\"ID de l’utilisateur.\";'),('fr','messages:apihelp-userrights-param-add','s:39:\"Ajouter l’utilisateur à ces groupes.\";'),('fr','messages:apihelp-userrights-param-remove','s:41:\"Supprimer l’utilisateur de ces groupes.\";'),('fr','messages:apihelp-userrights-param-reason','s:27:\"Motif pour la modification.\";'),('fr','messages:apihelp-userrights-example-user','s:141:\"Ajouter l’utilisateur <kbd>FooBot</kbd> au groupe <kbd>robot</kbd>, et le supprimer des groupes <kbd>sysop</kbd> et <kbd>bureaucrate</kbd>.\";'),('fr','messages:apihelp-userrights-example-userid','s:145:\"Ajouter l’utilisateur d’ID <kbd>123</kbd> au groupe <kbd>robot</kbd>, et le supprimer des groupes <kbd>sysop</kbd> et <kbd>bureaucrate</kbd>.\";'),('fr','messages:apihelp-watch-description','s:78:\"Ajouter ou supprimer des pages de la liste de suivi de l’utilisateur actuel.\";'),('fr','messages:apihelp-watch-param-title','s:66:\"La page à (ne plus) suivre. Utiliser plutôt <var>$1titles</var>.\";'),('fr','messages:apihelp-watch-param-unwatch','s:59:\"Si défini, la page ne sera plus suivie plutôt que suivie.\";'),('fr','messages:apihelp-watch-example-watch','s:42:\"Suivre la page <kbd>Page principale</kbd>.\";'),('fr','messages:apihelp-watch-example-unwatch','s:50:\"Ne plus suivre la page <kbd>Page principale</kbd>.\";'),('fr','messages:apihelp-watch-example-generator','s:67:\"Suivre les quelques premières pages de l’espace de nom principal\";'),('fr','messages:apihelp-format-example-generic','s:55:\"Renvoyer le résultat de la requête dans le format $1.\";'),('fr','messages:apihelp-dbg-description','s:68:\"Extraire les données au format de <code>var_export()</code> de PHP.\";'),('fr','messages:apihelp-dbgfm-description','s:98:\"Extraire les données au format de <code>var_export()</code> de PHP (affiché proprement en HTML).\";'),('fr','messages:apihelp-json-description','s:37:\"Extraire les données au format JSON.\";'),('fr','messages:apihelp-json-param-callback','s:167:\"Si spécifié, inclut la sortie dans l’appel d’une fonction fournie. Pour plus de sûreté, toutes les données spécifiques à l’utilisateur seront restreintes.\";'),('fr','messages:apihelp-json-param-utf8','s:235:\"Si spécifié, encode la plupart (mais pas tous) des caractères non ASCII en URF-8 au lieu de les remplacer par leur séquence d’échappement hexadécimale. Valeur par défaut quand <var>formatversion</var> ne vaut pas <kbd>1</kbd>.\";'),('fr','messages:apihelp-json-param-ascii','s:167:\"Si spécifié, encode toutes ses séquences d’échappement non ASCII utilisant l’hexadécimal. Valeur par défaut quand <var>formatversion</var> vaut <kbd>1</kbd>.\";'),('fr','messages:apihelp-json-param-formatversion','s:296:\"Mise en forme de sortie :\n;1:Format rétro-compatible (booléens de style XML, clés <samp>*</samp> pour les nœuds de contenu, etc.).\n;2:Format moderne expérimental. Des détails peuvent changer !\n;latest:Utilise le dernier format (actuellement <kbd>2</kbd>), peut changer sans avertissement.\";'),('fr','messages:apihelp-jsonfm-description','s:67:\"Extraire les données au format JSON (affiché proprement en HTML).\";'),('fr','messages:apihelp-none-description','s:17:\"Ne rien extraire.\";'),('fr','messages:apihelp-php-description','s:51:\"Extraire les données au format sérialisé de PHP.\";'),('fr','messages:apihelp-php-param-formatversion','s:298:\"Mise en forme de la sortie :\n;1:Format rétro-compatible (bool&ens de style XML, clés <samp>*</samp> pour les nœuds de contenu, etc.).\n;2:Format moderne expérimental. Des détails peuvent changer !\n;latest:Utilise le dernier format (actuellement <kbd>2</kbd>), peut changer sans avertissement.\";'),('fr','messages:apihelp-phpfm-description','s:81:\"Extraire les données au format sérialisé de PHP (affiché proprement en HTML).\";'),('fr','messages:apihelp-rawfm-description','s:100:\"Extraire les données avec les éléments de débogage au format JSON (affiché proprement en HTML).\";'),('fr','messages:apihelp-txt-description','s:65:\"Extraire les données au format de <code>print_r()</code> de PHP.\";'),('fr','messages:apihelp-txtfm-description','s:95:\"Extraire les données au format de <code>print_r()</code> de PHP (affiché proprement en HTML).\";'),('fr','messages:apihelp-xml-description','s:36:\"Extraire les données au format XML.\";'),('fr','messages:apihelp-xml-param-xslt','s:176:\"Si spécifié, ajoute la page nommée comme une feuille de style XSL. La valeur doit être un titre dans l’espace de noms {{ns:mediawiki}} se terminant par <code>.xsl</code>.\";'),('fr','messages:apihelp-xml-param-includexmlnamespace','s:44:\"Si spécifié, ajoute un espace de noms XML.\";'),('fr','messages:apihelp-xmlfm-description','s:66:\"Extraire les données au format XML (affiché proprement en HTML).\";'),('fr','messages:apihelp-yaml-description','s:37:\"Extraire les données au format YAML.\";'),('fr','messages:apihelp-yamlfm-description','s:57:\"Extraire les données YAML (affiché proprement en HTML).\";'),('fr','messages:api-format-title','s:33:\"Résultat de l’API de MediaWiki\";'),('fr','messages:api-format-prettyprint-header','s:418:\"Voici la représentation HTML du format $1. HTML est utile pour le débogage, mais inapproprié pour être utilisé dans une application.\n\nSpécifiez le paramètre <var>format</var> pour modifier le format de sortie. Pour voir la représentation non HTML du format $1, mettez <kbd>format=$2</kbd>.\n\nVoyez la [[mw:API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),('fr','messages:api-format-prettyprint-header-only-html','s:238:\"Ceci est une représentation HTML à des fins de déboguage, et n’est pas approprié à une utilisation applicative.\n\nVoir la [[mw:API|documentation complète]], ou l’[[Special:ApiHelp/main|aide de l’API]] pour plus d’information.\";'),('fr','messages:api-orm-param-props','s:21:\"Champs à rechercher.\";'),('fr','messages:api-orm-param-limit','s:37:\"Nombre maximal de lignes à renvoyer.\";'),('fr','messages:api-pageset-param-titles','s:45:\"Une liste des titres sur lesquels travailler.\";'),('fr','messages:api-pageset-param-pageids','s:52:\"Une liste des IDs de page sur lesquelles travailler.\";'),('fr','messages:api-pageset-param-revids','s:57:\"Une liste des IDs de révision sur lesquelles travailler.\";'),('fr','messages:api-pageset-param-generator','s:229:\"Obtenir la liste des pages sur lesquelles travailler en exécutant le module de recherche spécifié.\n\n<strong>NOTE :<strong> les noms de paramètre du générateur doivent être préfixés avec un « g », voir les exemples.\";'),('fr','messages:api-pageset-param-redirects-generator','s:170:\"Résoudre automatiquement les redirections dans <var>$1titles</var>, <var>$1pageids</var> et <var>$1revids</var>, et dans les pages renvoyées par <var>$1generator</var>.\";'),('fr','messages:api-pageset-param-redirects-nogenerator','s:113:\"Résoudre automatiquement les redirections dans <var>$1titles</var>, <var>$1pageids</var> et <var>$1revids</var>.\";'),('fr','messages:api-pageset-param-converttitles','s:219:\"Convertir les titres dans d’autres variantes si nécessaire. Fonctionne uniquement si la langue de contenu du wiki supporte la conversion en variantes. Les langues qui supportent la conversion en variante incluent $1.\";'),('fr','messages:api-help-title','s:28:\"Aide de l’API de MediaWiki\";'),('fr','messages:api-help-lead','s:142:\"Ceci est une page d’aide de l’API de MediaWiki générée automatiquement.\n\nDocumentation et exemples : https://www.mediawiki.org/wiki/API\";'),('fr','messages:api-help-main-header','s:16:\"Module principal\";'),('fr','messages:api-help-flag-deprecated','s:24:\"Ce module est obsolète.\";'),('fr','messages:api-help-flag-internal','s:105:\"<strong>Ce module est interne ou instable.</strong> Son fonctionnement peut être modifié sans préavis.\";'),('fr','messages:api-help-flag-readrights','s:43:\"Ce module nécessite des droits de lecture.\";'),('fr','messages:api-help-flag-writerights','s:46:\"Ce module nécessite des droits d’écriture.\";'),('fr','messages:api-help-flag-mustbeposted','s:45:\"Ce module n’accepte que les requêtes POST.\";'),('fr','messages:api-help-flag-generator','s:49:\"Ce module peut être utilisé comme générateur.\";'),('fr','messages:api-help-source','s:11:\"Source : $1\";'),('fr','messages:api-help-source-unknown','s:54:\"Source : <span class=\"apihelp-unknown\">inconnue</span>\";'),('fr','messages:api-help-license','s:19:\"Licence : [[$1|$2]]\";'),('fr','messages:api-help-license-noname','s:29:\"Licence : [[$1|Voir le lien]]\";'),('fr','messages:api-help-license-unknown','s:55:\"Licence : <span class=\"apihelp-unknown\">inconnue</span>\";'),('fr','messages:api-help-parameters','s:38:\"{{PLURAL:$1|Paramètre|Paramètres}} :\";'),('fr','messages:api-help-param-deprecated','s:10:\"Obsolète.\";'),('fr','messages:api-help-param-required','s:30:\"Ce paramètre est obligatoire.\";'),('fr','messages:api-help-datatypes-header','s:16:\"Type de données\";'),('fr','messages:api-help-datatypes','s:2006:\"Certains types de paramètre dans les requêtes de l’API nécessitent plus d’explication :\n;boolean\n:Les paramètres booléens fonctionnent comme des cases à cocher HTML : si le paramètre est spécifié, quelle que soit sa valeur, il est considéré comme vrai. Pour une valeur fausse, enlever complètement le paramètre.\n;timestamp\n:Les horodatages peuvent être spécifiés sous différentes formes. Date et heure ISO 8601 est recommandé. Toutes les heures sont en UTC, tout fuseau horaire inclus est ignoré.\n:* Date et heure ISO 8601, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (la ponctuation et <kbd>Z</kbd> sont facultatifs)\n:* Date et heure ISO 8601 avec fractions de seconde (ignorées), <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (tirets, deux-points et <kbd>Z</kbd> sont facultatifs)\n:* Format MédiaWiki, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Format numérique générique, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (fuseau horaire facultatif en <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, ou <kbd>-<var>##</var></kbd> sont ignorés)\n:* Format EXIF, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*Format RFC 2822 (le fuseau horaire est facultatif), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Format RFC 850 (le fuseau horaire est facultatif), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Format ctime C, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Secondes depuis 1970-01-01T00:00:00Z sous forme d’entier de 1 à 13 chiffres (sans <kbd>0</kbd>)\n:* La chaîne <kbd>now</kbd>\";'),('fr','messages:api-help-param-type-limit','s:31:\"Type : entier ou <kbd>max</kbd>\";'),('fr','messages:api-help-param-type-integer','s:49:\"Type : {{PLURAL:$1|1=entier|2=liste d’entiers}}\";'),('fr','messages:api-help-param-type-boolean','s:66:\"Type : booléen ([[Special:ApiHelp/main#main/datatypes|détails]])\";'),('fr','messages:api-help-param-type-timestamp','s:118:\"Type : {{PLURAL:$1|1=horodatage|2=liste d’horodatages}} ([[Special:ApiHelp/main#main/datatypes|formats autorisés]])\";'),('fr','messages:api-help-param-type-user','s:74:\"Type : {{PLURAL:$1|1=nom d’utilisateur|2=liste de noms d’utilisateur}}\";'),('fr','messages:api-help-param-list','s:90:\"{{PLURAL:$1|1=Une des valeurs suivantes|2=Valeurs (séparées par <kbd>{{!}}</kbd>)}} : $2\";'),('fr','messages:api-help-param-list-can-be-empty','s:54:\"{{PLURAL:$1|0=Doit être vide|Peut être vide, ou $2}}\";'),('fr','messages:api-help-param-limit','s:25:\"Pas plus de $1 autorisé.\";'),('fr','messages:api-help-param-limit2','s:46:\"Pas plus de $1 autorisé ($2 pour les robots).\";'),('fr','messages:api-help-param-integer-min','s:96:\"{{PLURAL:$1|1=La valeur doit être inférieure|2=Les valeurs doivent être inférieures}} à $2.\";'),('fr','messages:api-help-param-integer-max','s:110:\"{{PLURAL:$1|1=La valeur ne doit pas être supérieure|2=Les valeurs ne doivent pas être supérieures}} à $3.\";'),('fr','messages:api-help-param-integer-minmax','s:74:\"{{PLURAL:$1|1=La valeur doit|2=Les valeurs doivent}} être entre $2 et $3.\";'),('fr','messages:api-help-param-upload','s:75:\"Doit être envoyé comme un fichier importé utilisant multipart/form-data.\";'),('fr','messages:api-help-param-multi-separate','s:36:\"Valeurs séparées