,('fr','messages:gadgets-default','s:39:\"Activé pour tout le monde par défaut.\";'),('fr','messages:gadgets-legacy','s:156:\"Le gadget n’est pas chargé. Veuillez migrer vers ResourceLoader. ([https://www.mediawiki.org/wiki/ResourceLoader/Migration_guide_(users) En savoir plus])\";'),('fr','messages:gadgets-export','s:8:\"Exporter\";'),('fr','messages:gadgets-export-title','s:16:\"Export de gadget\";'),('fr','messages:gadgets-not-found','s:28:\"Gadget « $1 » non trouvé.\";'),('fr','messages:gadgets-export-text','s:483:\"Pour exporter le gadget $1, cliquez sur le bouton « {{int:gadgets-export-download}} », enregistrez le fichier téléchargé puis allez sur la page Special:Import du wiki de destination et importez-la. Ajoutez ensuite le texte suivant dans la page MediaWiki:Gadgets-definition :\n<pre>$2</pre>\nIl est nécessaire de disposer des droits correspondants sur le wiki de destination (y compris celui de modifier les messages système) et l’import depuis des fichiers doit être activé.\";'),('fr','messages:gadgets-export-download','s:13:\"Télécharger\";'),('fr','messages:apihelp-query+gadgetcategories-description','s:43:\"Renvoie une liste de catégories de gadget.\";'),('fr','messages:apihelp-query+gadgetcategories-param-prop','s:163:\"Quelle information de catégorie de gadget obtenir :\n;name:Nom de catégorie interne.\n;title:Titre de la catégorie.\n;members:Nombre de gadgets dans la catégorie.\";'),('fr','messages:apihelp-query+gadgetcategories-param-names','s:36:\"Noms des catégories à récupérer.\";'),('fr','messages:apihelp-query+gadgetcategories-example-1','s:54:\"Fournit une liste des catégories de gadget existantes\";'),('fr','messages:apihelp-query+gadgetcategories-example-2','s:66:\"Fournit toutes les informations sur les catégories \"foo\" et \"bar\"\";'),('fr','messages:apihelp-query+gadgets-description','s:52:\"Renvoie une liste des gadgets utilisés sur ce wiki.\";'),('fr','messages:apihelp-query+gadgets-param-prop','s:224:\"Quelle information de gadget 