lier).\";'),('en','messages:apihelp-feedcontributions-param-tagfilter','s:42:\"Filter contributions that have these tags.\";'),('en','messages:apihelp-feedcontributions-param-deletedonly','s:32:\"Show only deleted contributions.\";'),('en','messages:apihelp-feedcontributions-param-toponly','s:42:\"Only show edits that are latest revisions.\";'),('en','messages:apihelp-feedcontributions-param-newonly','s:40:\"Only show edits that are page creations.\";'),('en','messages:apihelp-feedcontributions-param-showsizediff','s:43:\"Show the size difference between revisions.\";'),('en','messages:apihelp-feedcontributions-example-simple','s:49:\"Return contributions for user <kbd>Example</kbd>.\";'),('en','messages:apihelp-feedrecentchanges-description','s:30:\"Returns a recent changes feed.\";'),('en','messages:apihelp-feedrecentchanges-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedrecentchanges-param-namespace','s:34:\"Namespace to limit the results to.\";'),('en','messages:apihelp-feedrecentchanges-param-invert','s:36:\"All namespaces but the selected one.\";'),('en','messages:apihelp-feedrecentchanges-param-associated','s:44:\"Include associated (talk or main) namespace.\";'),('en','messages:apihelp-feedrecentchanges-param-days','s:29:\"Days to limit the results to.\";'),('en','messages:apihelp-feedrecentchanges-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-feedrecentchanges-param-from','s:24:\"Show changes since then.\";'),('en','messages:apihelp-feedrecentchanges-param-hideminor','s:19:\"Hide minor changes.\";'),('en','messages:apihelp-feedrecentchanges-param-hidebots','s:26:\"Hide changes made by bots.\";'),('en','messages:apihelp-feedrecentchanges-param-hideanons','s:37:\"Hide changes made by anonymous users.\";'),('en','messages:apihelp-feedrecentchanges-param-hideliu','s:38:\"Hide changes made by registered users.\";'),('en','messages:apihelp-feedrecentchanges-param-hidepatrolled','s:23:\"H