age.\";'),('en','messages:apihelp-query+allmessages-param-from','s:41:\"Return messages starting at this message.\";'),('en','messages:apihelp-query+allmessages-param-to','s:39:\"Return messages ending at this message.\";'),('en','messages:apihelp-query+allmessages-param-title','s:77:\"Page name to use as context when parsing message (for $1enableparser option).\";'),('en','messages:apihelp-query+allmessages-param-prefix','s:33:\"Return messages with this prefix.\";'),('en','messages:apihelp-query+allmessages-example-ipb','s:44:\"Show messages starting with <kbd>ipb-</kbd>.\";'),('en','messages:apihelp-query+allmessages-example-de','s:66:\"Show messages <kbd>august</kbd> and <kbd>mainpage</kbd> in German.\";'),('en','messages:apihelp-query+allpages-description','s:54:\"Enumerate all pages sequentially in a given namespace.\";'),('en','messages:apihelp-query+allpages-param-from','s:41:\"The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-to','s:38:\"The page title to stop enumerating at.\";'),('en','messages:apihelp-query+allpages-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+allpages-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:20:\"Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-minsize','s:45:\"Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+allpages-param-maxsize','s:44:\"Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+allpages-param-prtype','s:30:\"Limit to protected pages only.\";'),('en','messages:apihelp-query+allpages-param-prlevel','s:85:\"Filter protections based on protection level (must be used with $1prtype= parameter).\";'),('en','messages:apihelp-query+allpages-param-prfiltercascade','s:76:\"Filter protections based on cascadingness (ignored when $1prtype isn\'t set).\";'),('en','messages