r the edit.\";'),('en','messages:apihelp-query+usercontribs-param-show','s:286:\"Show only items that meet these criteria, e.g. non minor edits only: <kbd>$2show=!minor</kbd>.\n\nIf <kbd>$2show=patrolled</kbd> or <kbd>$2show=!patrolled</kbd> is set, revisions older than <var>[[mw:Manual:$wgRCMaxAge|$wgRCMaxAge]]</var> ($1 {{PLURAL:$1|second|seconds}}) won\'t be shown.\";'),('en','messages:apihelp-query+usercontribs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+usercontribs-param-toponly','s:48:\"Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+usercontribs-example-user','s:46:\"Show contributions of user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+usercontribs-example-ipprefix','s:73:\"Show contributions from all IP addresses with prefix <kbd>192.0.2.</kbd>.\";'),('en','messages:apihelp-query+userinfo-description','s:39:\"Get information about the current user.\";'),('en','messages:apihelp-query+userinfo-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-blockinfo','s:66:\"Tags if the current user is blocked, by whom, and for what reason.\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-hasmsg','s:74:\"Adds a tag <samp>messages</samp> if the current user has pending messages.\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-groups','s:49:\"Lists all the groups the current user belongs to.\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-implicitgroups','s:67:\"Lists all the groups the current user is automatically a member of.\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-rights','s:42:\"Lists all the rights the current user has.\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-changeablegroups','s:61:\"Lists the groups the current user can add to and remove from.\";'),('en','messages:apihelp-query+userinfo-paramvalue-prop-options','s:47:\"Lists a