ally a member of.\";'),('en','messages:apihelp-query+users-paramvalue-prop-rights','s:35:\"Lists all the rights each user has.\";'),('en','messages:apihelp-query+users-paramvalue-prop-editcount','s:27:\"Adds the user\'s edit count.\";'),('en','messages:apihelp-query+users-paramvalue-prop-registration','s:39:\"Adds the user\'s registration timestamp.\";'),('en','messages:apihelp-query+users-paramvalue-prop-emailable','s:78:\"Tags if the user can and wants to receive email through [[Special:Emailuser]].\";'),('en','messages:apihelp-query+users-paramvalue-prop-gender','s:68:\"Tags the gender of the user. Returns \"male\", \"female\", or \"unknown\".\";'),('en','messages:apihelp-query+users-param-users','s:42:\"A list of users to obtain information for.\";'),('en','messages:apihelp-query+users-param-token','s:81:\"Use <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd> instead.\";'),('en','messages:apihelp-query+users-example-simple','s:47:\"Return information for user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+watchlist-description','s:60:\"Get recent changes to pages in the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-param-allrev','s:67:\"Include multiple revisions of the same page within given timeframe.\";'),('en','messages:apihelp-query+watchlist-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+watchlist-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+watchlist-param-namespace','s:44:\"Filter changes to only the given namespaces.\";'),('en','messages:apihelp-query+watchlist-param-user','s:31:\"Only list changes by this user.\";'),('en','messages:apihelp-query+watchlist-param-excludeuser','s:32:\"Don\'t list changes by this user.\";'),('en','messages:apihelp-query+watchlist-param-limit','s:45:\"How many total results to return per request.\";'),('en','messages:apihelp-query+watchlist-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-ids','s:31:\"Adds revision IDs and page IDs.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-title','s:23:\"Adds title of the page.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-flags','s:24:\"Adds flags for the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-user','s:32:\"Adds the user who made the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-userid','s:38:\"Adds user ID of whoever made the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-comment','s:25:\"Adds comment of the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-parsedcomment','s:32:\"Adds parsed comment of the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-timestamp','s:27:\"Adds timestamp of the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-patrol','s:30:\"Tags edits that are patrolled.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-sizes','s:41:\"Adds the old and new lengths of the page.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-notificationtimestamp','s:65:\"Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-loginfo','s:39:\"Adds log information where appropriate.\";'),('en','messages:apihelp-query+watchlist-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+watchlist-param-type','s:124:\"Which types of changes to show:\n;edit:Regular page edits.\n;external:External changes.\n;new:Page creations.\n;log:Log entries.\";'),('en','messages:apihelp-query+watchlist-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-param-token','s:148:\"A security token (available in the 