aded for users using the Cologne Blue skin */\";'),('en','messages:skinname-cologneblue','s:12:\"Cologne Blue\";'),('en','messages:cologneblue-desc','s:42:\"A lightweight skin with minimal formatting\";'),('en','messages:modern.css','s:58:\"/* CSS placed here will affect users of the Modern skin */\";'),('en','messages:modern.js','s:72:\"/* Any JavaScript here will be loaded for users using the Modern skin */\";'),('en','messages:skinname-modern','s:6:\"Modern\";'),('en','messages:modern-desc','s:65:\"A blue/grey theme with sidebar and top bar. Derived from MonoBook\";'),('en','messages:skinname-monobook','s:8:\"MonoBook\";'),('en','messages:monobook-desc','s:109:\"The classic MediaWiki skin since 2004, named after the black-and-white photo of a book in the page background\";'),('en','messages:monobook.css','s:60:\"/* CSS placed here will affect users of the MonoBook skin */\";'),('en','messages:monobook.js','s:74:\"/* Any JavaScript here will be loaded for users using the MonoBook skin */\";'),('en','messages:skinname-vector','s:6:\"Vector\";'),('en','messages:vector-skin-desc','s:74:\"Modern version of MonoBook with fresh look and many usability improvements\";'),('en','messages:vector.css','s:58:\"/* CSS placed here will affect users of the Vector skin */\";'),('en','messages:vector.js','s:72:\"/* Any JavaScript here will be loaded for users using the Vector skin */\";'),('en','messages:vector-action-addsection','s:9:\"Add topic\";'),('en','messages:vector-action-delete','s:6:\"Delete\";'),('en','messages:vector-action-move','s:4:\"Move\";'),('en','messages:vector-action-protect','s:7:\"Protect\";'),('en','messages:vector-action-undelete','s:8:\"Undelete\";'),('en','messages:vector-action-unprotect','s:17:\"Change protection\";'),('en','messages:vector-view-create','s:6:\"Create\";'),('en','messages:vector-view-edit','s:4:\"Edit\";'),('en','messages:vector-view-history','s:12:\"View history\";'),('en','messages:vector-view-view','s:4:\"Read\";'),('en','messages:vector-view-viewsource','s:11:\"View source\";'),('en','messages:vector-more-actions','s:4:\"More\";'),('en','messages:gadgets-desc','s:139:\"Lets users select custom [[Special:Gadgets|CSS and JavaScript gadgets]] in their [[Special:Preferences#mw-prefsection-gadgets|preferences]]\";'),('en','messages:prefs-gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-prefstext','s:535:\"Below is a list of special gadgets you can enable for your account.\nThese gadgets are mostly based on JavaScript, so JavaScript has to be enabled in your browser for them to work.\nNote that these gadgets will have no effect on this preferences page.\n\nAlso note that these special gadgets are not part of the MediaWiki software, and are usually developed and maintained by users on your local wiki.\nLocal administrators can edit the [[MediaWiki:Gadgets-definition|definitions]] and [[Special:Gadgets|descriptions]] of available gadgets.\";'),('en','messages:gadgets','s:7:\"Gadgets\";'),('en','messages:gadgets-definition','s:0:\"\";'),('en','messages:gadgets-title','s:7:\"Gadgets\";'),('en','messages:gadgets-pagetext','s:300:\"Below is a list of special gadgets users can enable on their [[Special:Preferences#mw-prefsection-gadgets|preferences page]], as defined by the [[MediaWiki:Gadgets-definition|definitions]].\nThis overview provides easy access to the system message pages that define each gadget\'s description and code.\";'),('en','messages:gadgets-uses','s:4:\"Uses\";'),('en','messages:gadgets-required-rights','s:54:\"Requires the following {{PLURAL:$2|right|rights}}:\n\n$1\";'),('en','messages:gadgets-required-skins','s:59:\"Available on the {{PLURAL:$2|$1 skin|following skins: $1}}.\";'),('en','messages:gadgets-default','s:32:\"Enabled for everyone by default.\";'),('en','messages:gadgets-legacy','s:140:\"Gadget is not loaded. Please migrate to ResourceLoader. ([https://www.mediawiki.org/wiki/ResourceLoader/Migration_guide_(users) Learn more])\";'),('en','messages:gadgets-export','s:6:\"E