INSERT INTO `wikinox_text` VALUES (1,'<strong>MediaWiki a été installé avec succès.</strong>\n\nConsultez le [//meta.wikimedia.org/wiki/Help:Contents/fr Guide de l’utilisateur] pour plus d’informations sur l’utilisation de ce logiciel de wiki.\n\n== Pour démarrer ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Liste des paramètres de configuration]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ/fr Questions courantes sur MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Liste de discussion sur les distributions de MediaWiki]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Adaptez MediaWiki dans votre langue]','utf-8'),(2,'\n<strong>Bienvenue sur le Wiki du Groupe Nox.</strong>','utf-8'),(3,'[http://localhost/Symfony/web/app_dev.php/accueil Retour à l\'intranet]','utf-8'),(4,'[http:///<?php echo $_SERVER[\'HTTP_HOST\']; ?>/Symfony/web/app_dev.php/accueil Retour à l\'intranet]','utf-8'),(5,'[http://<?php echo $_SERVER[\'HTTP_HOST\']; ?>/Symfony/web/app_dev.php/accueil Retour à l\'intranet]','utf-8'),(6,'[http://<?php echo $_SERVER[\'HTTP_HOST\'];?>/Symfony/web/app_dev.php/accueil Retour à l\'intranet]','utf-8'),(7,'[http://<?php echo $_SERVER[\'HTTP_HOST\']?>/Symfony/web/app_dev.php/accueil Retour à l\'intranet]','utf-8'),(8,'[http://192.168.35.218/Symfony/web/app_dev.php/accueil Retour à l\'intranet]','utf-8'),(9,'[http://192.168.35.218/Symfony/web/app.php/accueil Retour à l\'intranet]','utf-8'),(10,'sqdsqdsd','utf-8'),(11,'[http://<?php echo $_SERVER[\'HTTP_HOST\']; ?>/intranet Retour à l\'intranet]','utf-8'),(12,'[http://<nowiki><?php echo $_SERVER[\'HTTP_HOST\']; ?></nowiki>/intranet Retour à l\'intranet]','utf-8'),(13,'[http:/192.168.35.218/intranet Retour à l\'intranet]','utf-8'),(14,'[http://192.168.35.218/intranet Retour à l\'intranet]','utf-8'),(15,'aaaaaaa','utf-8'),(16,'\n<strong>Bienvenue sur le Wiki du Groupe Nox.</strong>\n\n\na ouais mais j\'ai l