es les pages\n\n* Index\n** Le BIM chez NOX Ingénierie|Le BIM chez NOX Ingénierie\n** {{Special:AllPages}}','utf-8'),(79,'* Navigation\n** mainpage|mainpage-description\n** http://192.168.35.218/intranet/accueil|Retour à l\'intranet\n** Spécial:Toutes_les_pages|Toutes les pages\n\n* Index\n** Le BIM chez NOX Ingénierie|Le BIM chez NOX Ingénierie\n** {{Special:AllPages}}|{{Special:AllPages}}','utf-8'),(80,'* Navigation\n** mainpage|mainpage-description\n** http://192.168.35.218/intranet/accueil|Retour à l\'intranet\n** Spécial:Toutes_les_pages|Toutes les pages\n\n* Index\n** Le BIM chez NOX Ingénierie|Le BIM chez NOX Ingénierie','utf-8'),(81,'\'\'\'Le BIM, c\'est quoi ?\'\'\'\n\nBlablabla\n\n\'\'\'Oui ok, mais pour nous ça change quoi ?\'\'\'\n\n- De manière générale : \n- Pour les projeteurs :\n- Pour les ingénieurs :\n- Pour le client :\n- Pour l\'image de l\'entreprise :\n\n\'\'\'Ah oui mais c\'est compliqué ? Quand est-ce que ça va bouger ?\'\'\'\n\n- Maintenant ! Plusieurs projets sont en cours et certaines équipes nox travaillent déjà dessus\n\nLes projets en cours sur le BIM\n- Projet A  (lister les intervenants, avec les agences + exemples de rendu)\n- Projet [[CFAO Bingerville]]\n- Projet [[LIDL]]\n\n\'\'\'Ok et après ?\'\'\'\n\nen R&D les techno VR, au stade expérimental blablabla','utf-8'),(82,'','utf-8'),(83,'Outils','utf-8'),(84,'\'\'\'Le BIM, c\'est quoi ?\'\'\'\n\nLe BIM c\'est le petit nom pour Building Information Modeling\nC\'est une façon de travailler sur une maquette commune, elle rassemble les \"productions\" de chacun sur un unique modèle.\nIl permet :\n- d\'articuler et de diagnostiquer en temps réel les interactions entre les divers corps de métier\n- d\'afficher en temps réel l\'évolution d\'un projet (en 3D) sans logiciel spécifique\n- en mode 4D d\'y associer une notion de \"temps\" (Project)\nEt bien plus encore ...\n\n\'\'\'Oui ok, mais pour nous ça change quoi ?\'\'\'\n\n- De manière générale : Nous devons tous travailler dela même manière.\n- Pour les projeteurs : Des outils pour créer des objets intelligents\n- Pour les ingénieurs :\n- Pour le client : un rendu réaliste et exploitable n\'importe où\n- Pour l\'image de l\'entreprise : \n\n\'\'\'Ah oui mais c\'est compliqué ? Quand est-ce que ça va bouger ?\'\'\'\n\n- Maintenant ! Plusieurs projets sont en cours et certaines équipes nox travaillent déjà dessus\n- Toute la suite AutoDESK 2016 est en cours de déploiement (InfraDesignSuite, BuildingDesignSuite etc...)\n\nLes projets en cours sur le BIM\n- Projet A  (lister les intervenants, avec les agences + exemples de rendu).\n- Projet [[CFAO Bingerville]].\n- Projet [[LIDL]].\n\n\'\'\'Ok et après ?\'\'\'\n\nen R&D les techno VR, au stade expérimental blablabla','utf-8'),(85,'<strong>Bienvenue sur <br />le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n- [[Le BIM chez NOX Ingénierie]]','utf-8'),(86,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n- [[Le BIM chez NOX Ingénierie]]','utf-8'),(87,'* Navigation\n** mainpage|mainpage-description\n** http://192.168.35.218/intranet/accueil|Retour à l\'intranet\n** Spécial:Toutes_les_pages|Toutes les pages\n\n* Index\n** Le BIM chez NOX Ingénierie|Le BIM chez NOX Ingénierie\n\n{% for Special:AllPages as Pages %}\n  ** Test|Pages\n{% endfor %}','utf-8'),(88,'* Navigation\n** mainpage|mainpage-description\n** http://192.168.35.218/intranet/accueil|Retour à l\'intranet\n** Spécial:Toutes_les_pages|Toutes les pages\n\n* Index\n** Le BIM chez NOX Ingénierie|Le BIM chez NOX Ingénierie','utf-8'),(89,'\'\'\'Le BIM, c\'est quoi ?\'\'\'\n\nLe BIM c\'est le petit nom pour Building Information Modeling<BR>\nC\'est une façon de travailler sur une maquette commune, elle rassemble les \"productions\" de chacun sur un unique modèle.<BR>\nIl permet :<BR>\n- d\'articuler et de diagnostiquer en temps réel les interactions entre les divers corps de métier<BR>\n- d\'afficher en temps réel l\'évolution d\'un projet (en 3D) sans logiciel spécifi