aquette numérique) ;<BR>\nBuilding Information Modeling (les méthodes) ;<BR>\nBuilding Information Management (le management).<BR>\n\nLe BIM est une méthode de travail permettant de recentrer les compétences de chacun des intervenants au cœur du projet via une approche collaborative et concourante. L’objectif est de construire virtuellement le projet sous la forme de maquettes numériques (MN). Ces MN vont permettre, grâce à l’expertise de chacun des membres de l’équipe, de mener des analyses pour optimiser le projet et faciliter les choix dès les premières phases de conception ainsi que de faire une synthèse au « fil de l’eau ». La taille du projet n’importe pas,<BR><BR>\nL’usage du BIM favorise le management de projet dans l’acte de construire et simplifie le travail itératif entre les différents acteurs. Le BIM est également un superviseur de contraintes efficaces : dès l’esquisse, il permet la vérification automatique des règles du plan local d’urbanisme et le respect de contraintes que le concepteur s’est lui‐même donné (performance bioclimatique, comparaison des modes constructifs, coût global sur l’enveloppe, empreinte environnementale). Cela n’affranchira pas le concepteur de mener des revues techniques de projet, afin de conserver la compréhension et la maitrise des évolutions de celui‐ci. A titre d’illustration, le format NBDM utilisé pour les calculs réglementaires thermiques (RT2012) par les bureaux d’étude thermiques est complémentaire du format IFC de la Maquette Numérique, permettant ainsi une synergie<BR>\n\n\'\'\'Ok, mais pour nous ça change quoi ?\'\'\'\n\n- De manière générale : Nous devons tous travailler de la même manière, ne plus penser en ligne 2D, mais en objet 3D intelligents.<BR>\n- Pour les projeteurs : Des nouveaux outils pour créer des objets.<BR>\n- Pour les ingénieurs : Des nouveaux process d\'exploitation.<BR>\n- Pour le client : Un rendu réaliste exploitable n\'importe où et sur n\'importe quel support.<BR>\n- Pour l\'image de l\'entreprise : L\'innovation !<BR>\n\n\'\'\'Ah oui mais c\'est compliqué ? Quand est-ce que ça va bouger ?\'\'\'\n\n- Maintenant ! Plusieurs projets sont en cours et certaines équipes NOX travaillent déjà dessus.<BR>\n- Toute la suite AutoDESK 2016 est en cours de déploiement (BuildingDesignSuite, InfraDesignSuite)\n\nLes projets BIM en cours.<BR>\n- Projet A  (lister les intervenants, avec les agences + exemples de rendu).<BR>\n- [[Projet BIM CFAO Bingerville]]<BR>\n- [[Projet BIM LIDL]]<BR>\n\n\'\'\'Ok et après ?\'\'\'\n\nPour le moment en R&D :<BR>\n- Visite sur un point de vue statique avec [http://www.google.fr GoogleCardboard] : Fonctionnel, facilement exploitable<BR>\n- Visite libre d\'un projet : En cours d\'étude','utf-8'),(124,'\'\'\'Le BIM, c\'est quoi ?\'\'\'\n\nIdées reçues, à chasser :<BR>\nLe BIM n’est pas un logiciel <BR>\nCe n’est pas de la 3D <BR>\nCe n’est pas un format<BR>\nCe n’est uniquement applicable sur les grosses opérations<BR>\nCe n’est pas une « usine à gaz ».<BR>\n\nEn France, on parle de Bâtiment et Informations Modélisées, en réalité, derrière cet acronyme se cachent trois notions indissociables <BR>\nBuilding Information Model (la maquette numérique) ;<BR>\nBuilding Information Modeling (les méthodes) ;<BR>\nBuilding Information Management (le management).<BR>\n\nLe BIM est une méthode de travail permettant de recentrer les compétences de chacun des intervenants au cœur du projet via une approche collaborative et concourante. L’objectif est de construire virtuellement le projet sous la forme de maquettes numériques (MN). Ces MN vont permettre, grâce à l’expertise de chacun des membres de l’équipe, de mener des analyses pour optimiser le projet et faciliter les choix dès les premières phases de conception ainsi que de faire une synthèse au « fil de l’eau ». La taille du projet n’importe pas,<BR><BR>\nL’usage du BIM favorise le management de projet dans l’acte de construire et simplifie le travail itératif entre les différents acteurs. Le B