innovation !<BR>\n\n\'\'\'Ah oui mais c\'est compliqué ? Quand est-ce que ça va bouger ?\'\'\'\n\n- Maintenant ! Plusieurs projets sont en cours et certaines équipes NOX travaillent déjà dessus.<BR>\n- Toute la suite AutoDESK 2016 est en cours de déploiement (BuildingDesignSuite, InfraDesignSuite)\n\nLes projets BIM en cours.<BR>\n- Projet A  (lister les intervenants, avec les agences + exemples de rendu).<BR>\n- [[Projet BIM CFAO Bingerville]]<BR>\n- [[Projet BIM LIDL]]<BR>\n\n\'\'\'Ok et après ?\'\'\'\n\nPour le moment en R&D :<BR>\n- Visite sur un point de vue statique avec [https://www.google.com/get/cardboard/ GoogleCardboard] : Fonctionnel, facilement exploitable<BR>\n- Visite libre d\'un projet : En cours d\'étude','utf-8'),(129,'','utf-8'),(130,'','utf-8'),(131,'','utf-8'),(132,'','utf-8'),(133,'Liste des intervenants :\n\n- Laurent MORISSEAU : Bim Manager (Bron)<BR>\n- Thierry KERUZORE : Structure BA (Lorient)<BR>\n- Arnaud POUZOLS : R&D (Bron)\n\n\nImages du projet:\n[[Fichier:CFAO_Bingerville_3D_coupe_Y.PNG]]\n\n\n\nRendu VR:\n\n[https://d1zjbwmh9kbk11.cloudfront.net/a360-rendering/panorama/pano.html?url=160304/8964/586d4d7a Voir]','utf-8'),(134,'\'\'\'Liste des intervenants :\'\'\'\n\n- Laurent MORISSEAU : Bim Manager (Bron)<BR>\n- Thierry KERUZORE : Structure BA (Lorient)<BR>\n- Arnaud POUZOLS : R&D (Bron)\n\n\'\'\'Détails du Projet :\'\'\'\nXXX m²\nMission NOX : AMO?? Bim Management\n\n\'\'\'Images du projet:\'\'\'\n\n[[Fichier:CFAO_Bingerville_3D_coupe_Y.PNG]]\n[[Fichier:CFAO Bingerville 3D coupe Y.PNG]]\n[[Fichier:CFAO Bingerville 3D coupe Z.PNG]] \n[[Fichier:CFAO Bingerville 3D int.PNG]]\n\n\'\'\'Rendu VR:\'\'\'\n\n<Iframe>https://d1zjbwmh9kbk11.cloudfront.net/a360-rendering/panorama/pano.html?url=160304/8964/586d4d7a</Iframe>\n[https://d1zjbwmh9kbk11.cloudfront.net/a360-rendering/panorama/pano.html?url=160304/8964/586d4d7a Voir]','utf-8'),(135,'\'\'\'Liste des intervenants :\'\'\'\n\n- Laurent MORISSEAU : Bim Manager (Bron)<BR>\n- Thierry KERUZORE 