(214,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages>:BIM</categorytree>','utf-8'),(215,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages>BIM</categorytree>','utf-8'),(216,'[[Fichier:CFAO Bingerville 3D.PNG|thumb]]\n[[Fichier:CFAO Bingerville 3D coupe Y.PNG|thumb]]\n[[Fichier:CFAO Bingerville 3D coupe Z.PNG|thumb]] \n[[Fichier:CFAO Bingerville 3D int.PNG|thumb]]\n\n\'\'\'Liste des intervenants :\'\'\'\n\n- Laurent MORISSEAU : Bim Manager (Bron)<BR>\n- Thierry KERUZORE : Structure BA (Lorient)<BR>\n- Arnaud POUZOLS : R&D (Bron)\n\n\'\'\'Détails du Projet :\'\'\'\n\nProjet : Construction nouveau centre commercial Carrefour à Bingerville<BR>\nSurface du projet : XXX m²<BR>\nMission NOX : AMO?? Bim Management\n\n\'\'\'Rendu VR:\'\'\'\n\n[https://d1zjbwmh9kbk11.cloudfront.net/a360-rendering/panorama/pano.html?url=160304/8964/586d4d7a Voir]\n\n<include iframe src=\"https://d1zjbwmh9kbk11.cloudfront.net/a360-rendering/panorama/pano.html?url=160304/8964/586d4d7a\" width=\"50%\" height=\"500px\" frameborder=\"0\" scrolling=\"no\" />\n\n[[Catégorie:BIM]]','utf-8'),(217,'[[Fichier:LIDL 3D.PNG|thumb]]\n[[Fichier:LIDL 3D coupe Z.PNG|thumb]]\n\n\'\'\'Liste des intervenants :\'\'\'\n\n- Laurent MORISSEAU : Bim Manager (Bron)<BR>\n- Arnaud POUZOLS : R&D (Bron)\n\n\'\'\'Détails du Projet :\'\'\'\n\nProjet : Concept LIDL<BR>\nSurface du projet : XXX m²<BR>\nMission NOX : Bim Management\n\n[[Catégorie:BIM]]','utf-8'),(218,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=0>BIM</categorytree>','utf-8'),(219,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=-1>BIM</categorytree>','utf-8'),(220,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100>BIM</categorytree>','utf-8'),(221,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:5%;\'>BIM</categorytree>','utf-8'),(222,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%;\'>BIM</categorytree>','utf-8'),(223,'[[Catégorie:Général]]','utf-8'),(224,'\'\'\'Le BIM, c\'est quoi ?\'\'\'\n\nIdées reçues, à chasser :<BR>\n- Le BIM n’est pas un logiciel <BR>\n- Ce n’est pas de la 3D <BR>\n- Ce n’est pas un format<BR>\n- Ce n’est uniquement applicable sur les grosses opérations<BR>\n- Ce n’est pas une « usine à gaz ».<BR>\n\nEn France, on parle de Bâtiment et Informations Modélisées, en réalité, derrière cet acronyme se cachent trois notions indissociables <BR>\n- Building Information Model (la maquette numérique) ;<BR>\n- Building Information Modeling (les méthodes) ;<BR>\n- Building Information Management (le management).\n\nLe BIM est une méthode de travail permettant de recentrer les compétences de chacun des intervenants au cœur du projet via une approche collaborative et concourante. L’objectif est de construire virtuellement le projet sous la forme de maquettes numériques (MN). Ces MN vont permettre, grâce à l’expertise de chacun des membres de l’équipe, de mener des analyses pour optimiser le projet et faciliter les choix dès les premières phases de conception ainsi que de faire une synthèse au « fil de l’eau ». La taille du projet n’importe pas.<BR>\nL’usage du BIM favorise le management de projet dans l’acte de construire et simplifie le travail itératif entre les différents acteurs. Le BIM est également un superviseur de contraintes efficaces : dès l’esquisse, il permet la vérification automatique des règles du plan local d’urbanisme et le respect de contraintes que le concepteur s’est lui‐même donné (performance bioclimatique, comparaison des modes constructifs, coût global sur l’enveloppe, empreinte environnementale). Cela n’affranchira pas le concepteur de mener des revues techniques de projet, afin de conserver la compréhension et la maitrise des évolutions de celui‐ci. A titre d’illustration, le format NBDM utilisé pour les calculs réglementaires thermiques (RT2012) par les bureaux d’étude thermiques est complémentaire du format IFC de la Maquette Numérique, permettant ainsi une synergie.\n\n\'\'\'Ok, mais pour nous ça change quoi ?\'\'\'\n\n- De manière générale : Nous devons tous travailler de la même manière, ne plus penser en ligne 2D, mais en objet 3D intelligents.<BR>\n- Pour les projeteurs : Des nouveaux outils pour créer des objets.<BR>\n- Pour les ingénieurs : Des nouveaux process d\'exploitation.<BR>\n- Pour le client : Un rendu réaliste exploitable n\'importe où et sur n\'importe quel support.<BR>\n- Pour l\'image de l\'entreprise : L\'innovation !<BR>\n\n\'\'\'Ah oui mais c\'est compliqué ? Quand est-ce que ça va bouger ?\'\'\'\n\n- Maintenant ! Plusieurs projets sont en cours et certaines équipes NOX travaillent déjà dessus.<BR>\n- Toute la suite AutoDESK 2016 est en cours de déploiement (BuildingDesignSuite, InfraDesignSuite)\n\nLes projets BIM en cours.<BR>\n- [[Projet BIM CFAO Bingerville]]<BR>\n- [[Projet BIM LIDL]]<BR>\n\n\'\'\'Ok et après ?\'\'\'\n\nPour le moment en R&D :<BR>\n- Visite sur un point de vue statique avec [https://www.google.com/get/cardboard/ GoogleCardboard] : Fonctionnel, facilement exploitable<BR>\n- Visite libre d\'un projet : En cours d\'étude\n\n[[Category:BIM]][[Category:Test]]','utf-8'),(225,'[[Fichier:LIDL 3D.PNG|thumb]]\n[[Fichier:LIDL 3D coupe Z.PNG|thumb]]\n\n\'\'\'Liste des intervenants :\'\'\'\n\n- Laurent MORISSEAU : Bim Manager (Bron)<BR>\n- Arnaud POUZOLS : R&D (Bron)\n\n\'\'\'Détails du Projet :\'\'\'\n\nProjet : Concept LIDL<BR>\nSurface du projet : XXX m²<BR>\nMission NOX : Bim Management\n\n[[Catégorie:BIM]]\n[[Category:Test]]','utf-8'),(226,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%;\'>BIM</categorytree><categorytree mode=pages depth=100 style=\'margin-left:3%;\'>Test</categorytree>','utf-8'),(227,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block\'>BIM</categorytree><categorytree mode=pages depth=100 style=\'margin-left:3%;\'>Test</categorytree>','utf-8'),(228,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block;\'>BIM</categorytree><categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block;\'>Test</categorytree>','utf-8'),(229,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block;\'>BIM</categorytree>\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block;\'>Test</categorytree>','utf-8'),(230,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; vertical-align:top;\'>BIM</categorytree>\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; vertical-align:top;\'>Test</categorytree>','utf-8'),(231,'<strong>Bienvenue sur le Wiki du Groupe NOX.</strong>\n\n\nSujets du Wiki :\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; vertical-align:top;\'>BIM</categorytree>\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; vertical-align:top;\'>BIM</categorytree>\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; vertical-align:top;\'>BIM</categorytree>\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; vertical-align:top;\'>BIM</categorytree>\n<categorytree mode=pages depth=100 style=\'margin-left:3%; display:inline-block; verti